INSERT INTO `qnas` VALUES (3,1,'#part1 Cerita horor KKN di Desa Penari terus-menerus menjadi pembicaraan warganet. tanda pagar (tagar) #kkndesapenari, yang kini berubah menjadi #kkndidesapenari, masih menjadi trending topic di posisi teratas Aplikasi Maba untuk wilayah Indonesia.','<p>Cerita asli ditulis oleh akun Twitter @SimpleM81378523 sejak Juli 2019. Ada dua versi yang diceritakan oleh akun Twitter tersebut. Pertama dari sudut pandang Widya, kedua dari sudut pandang Nur.</p><p>Buat kalian yang penasaran dengan cerita horor yang lagi viral, berikut ini kisah lengkapnya. Akun Twitter @SimpleM81378523 menceritakannya dari sudut pandang Nur.</p><p>Nur segera merapikan tempat tidurnya, hidup merantau demi menyelesaikan pendidikanya di universitas yang sudah menjadi impianya sejak kecil kini tinggal menunggu bulan demi bulan. hanya tinggal menyelesaikan tugas terakhirnya, salah satunya, adalah tugas pengabdian pd masyarakat</p><p>orang lebih mengenalnya dengan KKN (Kuliah kerja nyata).</p><p>Malam ini, Ayu, teman sefakultasnya, baru saja membicarakan tentang rencananya, bahwa, ia, sudah memiliki tempat yang cocok untuk pelaksanaan KKN mereka, dan Nur akan ikut dalam observasi pengenalan pada desa tersebut.</p><p>di\'sela Nur mempersiapkan keberangkatanya malam ini, ia teringat harus segera memberitahu temanya yang lain tentang observasi ini, karena ia tahu, bahwa KKN program mereka, harus di selesaikan bersama-sama. janji, sebagai sahabat yang harus lulus bersama-sama.</p><p>\"Wid, nang ndi?\"</p><p>(Wid, dimana?)</p><p>\"nang omah Nur, yo opo, wes oleh nggon KKN\'e\" (di rumah Nur, gimana, sudah dapat tempat KKN\'nya)</p><p>\"engkok bengi Wid aku budal karo Ayu, doaken yo\" (nanti malam Wid, aku berangkat sama Ayu, doakan ya)</p><p>\"nggih. semoga di acc ya\"</p><p>\"Aamiin\" balas Ayu, mematikan telpon</p><p>balas Nur mematikan telpon*</p><p>detik-demi detik berputar, tanpa terasa malam telah tiba, Nur melihat sebuah mobil kijang mendekat. dari dalam, keluar sahabatnya Ayu, di belakangnya, ada sosok lelaki.</p><p>mungkin itu adalah mas Ilham, kakak Ayu. pikir Nur dalam hati.</p><p>\"Ayo. budal\" kata Ayu, menggandeng Nur agar segera masuk ke dalam mobil.</p><p>mas Ilham membawakan barang Nur, kemudian mobil pun mulai berangkat.</p><p>\"adoh gak Yu\" (jauh tidak yu) tanya Nur,</p><p>\"paling 4 sampe 6 jam, tergantung, ngebut ora\" (paling 4 sampai 6 jam, tergantung ngebut ndak)</p><p>\"sing jelas, desa\'ne apik, tak jamin, masih alami. pokok\'e cocok gawe proker sing kene susun wingi\" (yang jelas, desanya bagus, tak jamin, masih alami, pokoknya cocok buat proker yang kita susun kemarin)</p><p>Ayu terlihat begitu antusias, sementara Nur, ia merasa tidak nyaman.</p><p>banyak hal yang membuat Nur bimbang, salah satunya, tentang lokasi dan sebagainya. sejujurnya, ini kali pertama Nur, pergi ke arah etan (Timur) sebagai, perempuan yang lahir di daerah kulon (barat) ia sudah seringkali mendengar rumor tentang arah etan, salah satunya, kemistisanya</p><p>Mistis, bukan hal yang baru bagi Nur, bahkan ia sudah kenyang dengan berbagai pengalaman akan hal itu, saat menempuh pendidikanya sebagai santriwati, mengabaikan perasaan tidak bisa di lakukan secara kebetulan semata. dan malam ini, belum pernah Nur merasa setidak\'enak ini.</p><p>benar saja. perasaan tidak enak itu, terus bertambah seiring mobil terus melaju, salah satu pertanda buruk itu adalah ketika, sebelum memasuki kota J, dimana tujuanya kota B, Nur melihat kakek-kakek yang meminta uang di persimpangan, ia seakan melihat Nur. tatapanya, prihatin.</p><p>bukan hanya itu saja, si kakek, mengelengkan kepalanya, seolah memberikan tanda pada Nur yang ada didalam mobil, untuk mengurungkan niatnya.</p><p>namun, Nur, tidak bisa mengambil spekulasi apapun, ada temanya yang lain, yang menunggu kabar baik dari observasi hari ini.</p><p>hujan tiba-tiba turun, tanpa terasa, 4 jam lebih perjalanan ini ditempuh. Mobil berhenti di sebuah tempat rest area yang sepi, sebelum akhirnya melanjutkan perjalanan, Nur, melihat hutan gelap, yang memanggil-manggil namanya.</p><p>\"Hutan. desa ini ada di dalam hutan\" kata mas Ilham.</p><p>Nur tidak berkomentar, ia hanya berdiri di samping mobil yang berhenti di tepi jalan hutan ini. sebuah hutan yang sudah di kenal oleh semua orang jawatimur.</p><p>Hutan D********, tidak beberapa lama, nyala lampu dan suara motor terdengar. mas Ilham, melambaikan tanganya.</p><p>\"iku wong deso\'ne, melbu\'ne kudu numpak motor, gak isok numpak mobil soale\" (itu orang desanya, masuknya harus naik motor, mobil tidak bisa masuk soalnya)</p><p>Nur dan Ayu, mengangguk, pertanda ia mengerti. tanpa berpikir panjang, Nur sudah duduk di jok belakang, dan mereka berangkat</p><p>memasuki jalan setapak, dengan tanah tidak rata, membuat Nur harus memegang kuat- jaket bapak yang memboncengnya, tanah masih lembab, di tambah embun fajar sudah terlihat disana-sini, malu-malu memenuhi pepohonan rimbun. Nur, melihat sesosok, wanita. ia sedang menari di atas batu</p><p>kilatan matanya tajam, dengan paras elok nan cantik, si Wanita, tersenyum menyambut tamu yang sudah ia tunggu.</p><p>melihatnya dari balik jalan lain, Nur mendapati, si wanita sudah hilang, tanpa jejak. ia tahu, dirinya sudah di sambut dengan entah apa itu.</p><p>memasuki Desa, mas Ilham berpeluk kangen dengan seorang pria yang mungkin seumuran dengan ayahnya di rumah.</p><p>pria itu ramah, dan murah senyum, menyambut tanganya, Nur mendengar si pria memperkenalkan diri.</p><p>\"kulo, Prabu\" (saya Prabu)</p><p>\"sepurane Ham, aku eroh, kene wes kenal suwe, tapi deso iki gak tau loh gawe kegiatan KKN\" (saya minta maaf ham, aku tahu, kita sudah kenal lama, tapi desa ini tidak pernah di pakai kegiatan KKN)</p><p>\"tolong lah mas\" kata mas Ilham, \"dibantu, adikku,\"</p><p>suasana saat itu, tegang.</p><p>\"GAK ISOK HAM\" kata pak Prabu menekan mas Ilham dengan ekspresi tak terduga.</p><p>\"ngeten loh pak, ngapunten, kulo nyuwun tolong, kulo bakal jogo sikap ten mriki, mboten neko-neko, tolong pak\" (begini loh pak, maaf, saya minta tolong, saya akan menjaga sikan disini)</p><p>(saya tidak akan aneh-aneh. tolong pak) ucap Ayu, matanya berlinangan air mata, ia tidak pernah melihat Ayu sengotot ini, mimik wajah pak Prabu yang sebelumnya mengeras, kini melunak.</p><p>\"piro sing KKN dek?\" (berapa yang KKN nanti dek?)</p><p>dengan bersemangat Ayu menjawab. \"6 pak\"</p><p>hari itu berakhir, dengan persetujuan pak Prabu dan tentu saja, masyarakat sekitar, sebelum meninggalkan tempat itu, Ayu dan Nur berkeliling memeriksa desa sebentar.</p><p>disana ia sudah tahu proker apa saja yang akan menjadi wacana mereka, salah satunya, kamar mandi dengan air sumur</p><p>ia tahu, masyarakat mendapatka akses air hanya dari sungai, jadi terfkirkan mungkin sumur lebih efisien, di tengah mereka merundingkan berbagai proker kelak, Nur, terdiam melihat sebuah batu yang di tutup oleh kain merah.</p><p>di bawahnya, ada sesajian lengkap dengan bau kemenyan.</p><p>diatasnya, berdiri sosok hitam, dengan mata picing, menyala merah. meski hari siang bolong, Nur bisa melihat, kulitnya yang di tutup oleh bulu, serta tanduk kerbau, mata mereka saling melihat satu sama lain, sebelum Nur mengatakan pada Ayu, bahwa, mereka harus pulang.</p><p>\"lapo to Nur, kok gopoh men\" (kenapa sih Nur, kok kamu buru buru pergi)</p><p>\"kasihan mas Ilham, wes ngenteni\" ucap Nur.</p><p>\"yo wes, ayok\" Ayu menimpali.</p><p>mereka pun segera naik motor, sebelum keluar dari desa itu. sosok yang Nur lihat, apalagi bila bukan Genderuwo.</p><p>\"Nur, jak\'en Bima, yo, ambek Widya, engkok ambek kenalanku, kating\" (Nur, ajak si Bima, sama Widya, sama kenalanku kating) ucap Ayu didalam mobil.</p><p>\"Bima, lapo ngejak cah kui\" (ngapain sih ngajak Bima)</p><p>\"ben rame, kan wes kenal suwe\" (biar rame, kan sudah kenal lama) sahut Ayu</p><p>\"kok gak awakmu sing ngejak to\" (kenapa bukan kamu saja yang ngajak) timpal Nur.</p><p>\"kan awakmu biyen sak pondok\'an, wes luwih suwe kenal\" (kan kalian pernah satu pondok, jadi sudah kenal lebih lama) \"pokok\'e jak en arek iku yo\" (pokoknya ajak anak itu ya)</p><p>\"yo wes, iyo\" Nur pun mengalah.</p><p>\"tak telpone Widya, ben cepet di gawekno Proposal\'e mumpung pihak kampus gurung ngerilis daftar KKN\'e, gawat kalau pihak kampus wes ngerilis yo, mumpung wes oleh enggon KKN dewe\" (biar Widya tak telpon, biar cepat di buatkan proposalnya)</p><p>(mumpung kampus belum buat daftar KKN nya, bisa gawat kalau sampai kampus udah buat daftarnya, mumpung kita sudah punya tempat KKN nya)</p><p>pelan, mobil itu pun meninggalkan jalanan hutan itu. Nur dan Ayu, kembali ke kotanya, mempersiapkan semua, sebelum mereka nanti kembali.</p><p>siang itu, Nur melihat Widya dan Ayu di hari pembekalan sebelum keberangkatan KKN mereka.</p><p>setelah menunggu cukup lama, akhirnya 2 orang yang akan bergabung dalam kelompok KKN mereka pun muncul, namanya adalah Wahyu dan Anton. mereka pun membicarakan semua proker dan menentukan-</p><p>jadwal keberangkatan. semua anak sudah setuju, termasuk Widya, yang hampir sepanjang hari terus menceritakan, bahwa ibunya memiliki firasat yang buruk pada tempat KKN mereka. Nur hanya diam dan mendengar, karena di dalam dirinya, ia merasakan hal yang sama.</p><p>Malam keberangkatan, Nur, Widya, Ayu, Bima, Wahyu dan Anton, sudah berkumpul, perjalanan di lanjutkan dengan mobil elf yang sudah mereka sewa untuk mengantarkan mereka ke pemberhentian dimana nanti mereka akan di jemput oleh warga desa. Nur masih bisa melihat temanya, Widya,</p><p>memasang wajah tidak nyaman.</p>','',NULL,'https://api.maba.my.id/storage/1/1603672784.jpg',NULL,NULL,NULL,1,NULL,1,0,144,1,1,NULL,NULL,'2020-10-25 09:39:44','2021-01-13 06:09:00',NULL),(2,1,'Halo Aku Anonim, Kamu bisa posting sebagai anonim, bisa posting di group sesuai dengan keadaan kamu hari ini.. kalau lagi marah / sedih bisa curhat di group :)',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,0,98,1,0,NULL,NULL,'2020-10-25 09:13:03','2020-11-26 03:07:30',NULL),(4,1,'#part2 Cerita horor KKN di Desa Penari terus-menerus menjadi pembicaraan warganet. tanda pagar (tagar) #kkndesapenari, yang kini berubah menjadi #kkndidesapenari, masih menjadi trending topic di posisi teratas Aplikasi Maba untuk wilayah Indonesia.','<p>hanya sebuah harap, yang Nur panjatkan, bahwa mereka berangkat dengan utuh dan semoga, pulang dengan utuh juga.</p><p>tetapi, tidak ada yang tahu, doa seperti apa yang akan di ijabah oleh tuhan.</p><p>gerimis mulai turun, sepanjang perjalanan, Nur hanya melihat ke jalanan yang lengang.</p><p>tepat di pemberhentian lampu merah, seseorang, menggebrak kaca mobil Elf\'nya, Nur begitu terkejut sampai tersentak mundur, dari dalam mobil, Nur melihat pengemis tua itu, ia terus menggebrak</p><p>mobil, membuat semua yg ada didalam mobil kebingungan, termasuk si sopir yang berteriak agar lelaki tua itu berhenti sembari melemparkan recehan, dari bibirnya, Nur melihat ia berucap</p><p>\"ojok budal ndok\" (jangan berangkat nak) suaranya terdengar familiar, seperti suara wanita tua</p><p>sampailah mereka ditempat pemberhentian, setelah menunggu, terlihat rentetan cahaya motor mendekat dari seberang jalan setapak, Nur mengatakanya. \"iku wong deso sing nyusul rek\" (itu orang dari desanya yang jemput kita)</p><p>tanpa membuang waktu, mereka pun melanjutkan perjalan.</p><p>jalanan setapak, dengan lumpur karena gerimis, pohon besar dan gelap, dengan kabut disana-sini, terlihat di sepanjang perjalanan.</p><p>hanya terdengar suara motor berderu, tanpa ada suara binatang malam, namun, semua berubah ketika tiba-tiba, dari jauh, terdengar suara gamelan.</p><p>suaranya sayup-sayup jauh, namun, semakin lama semakin terdengar jelas, Nur mengamati tempat itu, aroma bunga melati tercium menyengat di hidungnya</p><p>masih mencari, darimana suara itu terdengar, tepat di antara rerumputan di samping jalan setapak. terlihat, seorang wanita menunduk</p><p>ia menunduk, kemudian melihat Nur, di ikuti dengan lenggak-lenggok lehernya, serta ayunan gerakan tangan dan lenganya, yang bergerak seirama dengan suara gamelan, Nur melihat wanita itu menari.</p><p>menari di tengah malam, di tengah, kegalapan hutan yang sunyi senyap.</p><p>gerakanya begitu anggun, meski motor terus bergerak, Nur bisa melihat ia menari dengan sangat mempesona, seakan-akan ia bertunjuk untuk sebuah panggung yang tidak bisa Nur lihat.</p><p>siapa yang menari di malam buta seperti ini. Nur terdiam dalam kengerian yang ia rasakan sendirian.</p><p>ketika motor berhenti dan sampailah di desa, Nur tidak mengatakan apapun, ia melihat pak Prabu menyambut mereka, saat pak Prabu mempersilahkan mereka ke tempat peristirahatan mereka selama di desa ini, Widya tiba-tiba mengatakanya.</p><p>\"Pak, kok Deso\'ne pelosok men yo\"</p><p>(Pak, kok desanya jauh sekali ya)</p><p>\"pelosok yo opo to mbak, wong tekan dalam gede mek 30 menit loh\" (pelosok darimana sih mbak, orang dari jalan raya hanya 30 menit)</p><p>Nur hanya melihat saja, ia tidak mau mengatakan apapun, termasuk wajah Ayu yg memerah entah karena malu atau apa.</p><p>mungkin, Ayu merasa Widya sudah melakukan hal yang tidak sopan, sebagai tamu, Widya memang seharusnya tidak mengatakan itu. di tengah perdebadan antara Widya dan Ayu, tiba2 dari balik pohon jauh, sosok hitam dengan mata merah tengah mengintai mereka. sialnya, hanya Nur yg melihat</p><p>akhirnya, perdebadan itu selesai, Nur meninggalkan sosok itu, yg masih mengintip dari balik pohon</p><p>ia masuk ke sebuah rumah milik salah satu warga yang tidak berkeberatan, untuk mereka tinggali selama menjalankan tugas KKN mereka, disana rupanya perdebadan Widya dan Ayu berlanjut</p><p>\"koen iku kok ngeyel seh, wes dikandani, gak sampe setengah jam iku mau\" (kamu kok keras kepala, sudah dikasih tau, tadi gak sampai setengah jam)</p><p>Nur masih melihat, alih-alih menengahi, Nur lebih kepikiran dengan hal lain, salah satunya, genderuwo itu, untuk apa ia mengintainya.</p><p>namun, tetiba, Widya mengatakan sesuatu yang membuat Nur tidak bisa mengabaikanya.</p><p>\"Awakmu mau krungu ta gak, onok suoro gamelan nang tengah alas mau?\" (kamu tadi dengar atau tidak, ada suara gamelan di tengah hutan tadi?!)</p><p>namun ucapan Widya di tanggapi Ayu dengan nada mengejek. \"halah, palingan yo onok acara nang deso tetangga, opo maneh\" (halah, paling tadi kebetulan ada yang mengadakan acara di desa tetangga, apalagi)</p><p>Nur, yang mendengar itu bereaksi pada Ayu.</p><p>\"Yu, gak onok loh deso maneh nang kene)</p><p>\"jare wong biyen, nek krungu suoro gamelan, iku pertanda elek\" (kata orang dulu, bila mendengar suara gamelan, itu artinya sebuah pertanda buruk)</p><p>Malam itu, berakhir, meski perdebadan masih terus berlanjut di batin mereka masing-masing.</p><p>pertanda apa yang sudah menunggu</p><p>\"Yu, aku kepingin ngomong, wong loro ae, isok kan\" (Yu, aku ingin ngomong, sebentar, bisa kan?)</p><p>\"ngomong opo Nur?\" (ngomong apa Nur) tanya Ayu,</p><p>Nur dan Ayu pergi ke pawon (dapur) , wajah Nur, masih tegang, ia masih ingat, matanya tidak mungkin salah, ia melihat makhluk itu.</p><p>\"Yu, aku takon. awakmu gak ngerasa aneh tah gok deso iki, awakmu jek iling, kok iso-isone pak Prabu sampek ngelarang keras, kene KKN nang kene. opo awakmu gak curiga blas tah\"</p><p>(Yu, aku mau tanya, kamu gak ngerasa aneh\'kah di desa ini, kamu ingat, kok bisa-bisanya pak Prabu sampai, melarang keras, kita KKN disini, apa kamu gak curiga)</p><p>\"Opo seh maksudmu ngomong ngunu?!\" (apa sih maksudmu ngomong kaya gitu?!) ucap Ayu ketus.</p><p>\"bekne, pak Prabu nduwe alasan, lapo ngelarang awak dewe KKN nang kene\" (mungkin, pak Prabu punya alasan, kenapa melarang kita KKN disini)</p><p>\"nek awakmu ngomong ngene, soale perkoro Widya mau, ra masuk akal Nur, awakmu melu observasi nang kene kan ambek aku, opo onok sing aneh? gak kan. wes talah, mek pirang minggu tok ae loh\" (kalau kamu ngomong begini karena perkara Widya tadi, gak masuk akal Nur-</p><p>kamu sendiri ikut aku observasi disini kan, apa ada yang aneh? gak kan, sudahlah, cuma beberapa minggu aja loh)</p><p>Ayu pergi, meninggalkan Nur. sementara Nur, tidak mungkin menceritakan apa yang ia lihat, Ayu bahkan tidak percaya dengan hal yang ghaib. Nur pun mengalah lagi.</p><p>\"Nur\" Widya memanggil, Nur pun menatap wajahnya yang sayu, tampak ia baru saja menangis, tidak aneh memang, siapa yang tidak akan menangis bila merasakan hal yang bahkan tidak masuk diakal seperti itu. \"isok gak, aku jalok tulung\" (bisa aku minta tolong) ucap Widya.</p><p>\"tolong, ojok ceritakno yo, soal aku krungu gamelan mau, gak enak ambek warga kampung, kene kan tamu nang kene\" (tolong jangan ceritakan ya, soal tadi, soal aku dengar gamelan, aku gak enak kalau sampai kedengaran warga desa, kita kan tamu disini)</p><p>Nur hanya mengangguk.</p><p>namun, sebelum Widya beranjak dari tempatnya, Nur tiba-tiba mengatakanya. \"Wid, asline aku mau yo krungu suara iku mau, malah, aku ndelok onok penari\'ne nang pinggir tulangan mau\" (Wid, sebenarnya, aku juga mendengar suara gamelan itu, malah, aku melihat ada yang menari disana)</p><p>Widya yang mendengar itu dari Ayu, seakan tidak percaya, mereka terdiam cukup lama, bingung harus bereaksi seperti apa.</p><p>\"wes, Nur, jogo awak dewe-dewe yo, insyallah, gak bakal onok kejadian opo-opo nek kene hormat lan junjung unggah-ungguh selama nang kene\"</p><p>(sudah Nur, jaga diri baik-baik, ya, insyallah, gak bakal terjadi apa-apa, kalau kita hormat dan menjunjung sopan santun selama tinggal di tempat ini\"</p><p>ucapan Widya setidaknya membuat Nur sedikit lebih legah, namun, Nur tidak menceritakan tentang sosok Hitam yang mengintai mereka</p>','',NULL,'https://api.maba.my.id/storage/1/1603672988.jpg',NULL,NULL,NULL,1,NULL,1,0,148,1,1,NULL,NULL,'2020-10-25 09:43:08','2021-01-13 06:09:00',NULL),(5,1,'#part3 Cerita horor KKN di Desa Penari terus-menerus menjadi pembicaraan warganet. tanda pagar (tagar) #kkndesapenari, yang kini berubah menjadi #kkndidesapenari, masih menjadi trending topic di posisi teratas Aplikasi Maba untuk wilayah Indonesia.','<p>Malam pertama, Nur, Ayu dan Widya tidur dalam satu kamar yang sama, mereka sepakat untuk menggelar tikar, Nur ada di tengah, sementara Ayu dan Widya ada disamping kanan dan kiri Nur.</p><p>terdengar binatang malam bersahut-sahutan, berlomba untuk menunjukkan eksistensinya.</p><p>manakala Nur sadar, 2 sahabatnya sudah tertidur lelap, ia terjaga sendirian menatap langit-langit yang berupa genting hitam dengan sarang labah-labah.</p><p>rumah desa, tentu saja. pikir Nur, memaklumi, sekat kamarpun tidak menyentuh langit, jadi Nur, bisa melihat celah disana.</p><p>ketika memikirkan kejadian hari ini, Nur tiba-tiba tersadar, bahwa, suara riuh binatang malam tidak lagi terdengar, berganti dengan suara sunyi yang memekik membuat telinga Nur menjerit dalam ngeri.</p><p>perasaan tidak enak, tiba-tiba muncul begitu saja. membuat Nur, lebih awas.</p><p>ketika pandanganya, mencoba mencari cara untuk mengurangi rasa takutnya, di tengah cahaya lampu petromax yang memancarkan sinar temberam, di sudut sekat kamar, sosok bermata merah, mengintipnya.</p><p>Nur tercekat, ia beringsut mundur, menutup wajahnya dengan selimut yang ia bawa.</p><p>pancaran wajahnya terbayang didalam kepala Nur, mengingatnya, benar-benar membuat jantung di dadanya, berdegup kencang. ia masih ingat, tanduk kerbau di kepalanya, pancaran amarahnya seolah membuat Nur, semakin tersudut dalam ketakutan.</p><p>tanpa sadar, Nur mulai membaca ayat kursi.</p><p>satu dari banyak ayat yang diajarkan gurunya, untuk menolak rasa takut, untuk menunjukkan manusia memiliki kekuatan untuk melawan, namun, setiap ia menyelesaikan satu panjatan doa, di ikuti oleh suara papan kayu yang di gebrak dengan serampangan.</p><p>kerasnya suara itu, menghantam,</p><p>Nur mulai menangis, menangis sendirian, ia tahu, makhluk itu masih disana, tidak terima dengan apa yang ia lakukan, salahkah bila ia meminta bantuan pada tuhan.</p><p>salahkah.</p><p>tepat ketika isi hati Nur menyeruak, perlahan, suara itu menghilang, hilang, hilang, berganti hening.</p><p>Nur terbangun ketika subuh memanggil, ia masih belum mengerti, apakah itu mimpi, atau benar-benar terjadi, yang ia tahu, ia harus menjalankan tugasnya, sebagai seorang muslimah yang taat, ia, tidak boleh meninggalkan sholat.</p><p>Nur, hanya meyakinkan dirinya, tidak akan bercerita-</p><p>bahkan, kepada 2 sahabatnya, atas apa yang barusaja menimpanya.</p><p>pagi hari, pak Prabu mengumpulkan semua anak. mengatakan bahwa hari ini, ia akan memperkenalkan keseluruhan desa, dan mana saja yang bisa di jadikan proker untuk mereka kerjakan sesuai kesepakatan per\'anak.</p><p>pak Prabu menjelaskan sembari berjalan, sementara anak-anak mengikutinya</p><p>tidak ada yang menarik dari penjelasan pak Prabu tentang desa itu, bahkan pak Prabu terkesan menyembunyikan sejarah desa itu, membuat Nur semakin curiga, selain hal-hal umum, hanya Wahyu, kating\'nya yang selalu menimpali ucapak pak Prabu dengan candaan, membuat tawa\'nya pecah</p><p>semua terasa alami, seperti KKN yang Nur bayangkan, sampai, mereka berhenti di sebuah tempat yang membuat Nur tidak nyaman. sebuah pemakaman, di sampingnya, banyak pohon beringin besar.</p><p>selain itu, pemandangan pemakaman itu, juga terkesan sangat aneh.</p><p>setiap patek (batu nisan) ditutupi dengan kain hitam, membuat Nur, atau semua orang, merasa penasaran, apa alasanya?</p><p>namun Nur, merasakan angin dingin, seperti mengelilinginya, ia tahu, ada yang tidak beres dengan tempat ini. seakan-akan, tempat ini, sudah menolaknya.</p><p>ada satu hal yang membuat Nur semakin curiga kepada pak Prabu, dimana tiba-tiba, ia terpicu oleh kalimat Wahyu, kemudian beliau melontarkan ucapan bernada mengancam, seakan-akan, pak Prabu menjaga sesuatu yang sakral namun mengancam. apa yang pak Prabu sebenarnya sembunyikan?!</p><p>untungnya, Bima langsung menengahi insiden itu, membuat pak Prabu kembali menjadi pak Prabu yang sebelumnya.</p><p>namun, Nur, seakan tahu, ia tidak sanggup lagi mengikuti kegiatan keliling desa ini, maka ia, ijin pamit untuk kembali ke penginapan, untungnya, pak Prabu mengijinkanya.</p><p>Bima, menawarkan diri untuk mengantar Nur, dan pak Prabu sekali lagi, mengijikan.</p><p>semua anak melanjutkan tour mereka bersama pak Prabu, sementara Nur dan Bima, berjalan kembali ke area rumah tempat mereka menginap.</p><p>\"onok opo Nur? setan maneh?\" (ada apa Nur? ada hantu lagi?)</p><p>dari semua anak, memang tidak ada yang lebih mengenal Nur daripada si Bima, temanya bahkan saat mondok dulu.</p><p>Nur hanya tersenyum kecut, menjawabnya seadanya, bila mungkin kesehatanya sudah menurun, namun Bima tahu, Nur berbohong.</p><p>\"nang kuburan mau, rame ya\" (di pemakaman tadi, rame ya)</p><p>ucapan Bima tidak di gubris sama sekali dengan Nur, sehingga Bima akhirnya menyerah, di tengah perjalanan pulang itu, tiba-tiba Bima menanyakan sesuatu yang membuat Nur menaruh curiga pada Bima.</p><p>\"Nur, aku takok. Widya wes nduwe pacar rung?\"</p><p>(Nur, Widya itu sudah punya pacar apa belum sih?)</p><p>\"piye?\" (gimana?) tanya Nur lagi.</p><p>\"kancamu\" (temanmu) \"Widya loh, wes onok pacar opo durung?\" (Widya loh, sudah punya pacar apa belum?)</p><p>\"takono dewe ae yo\" (tanyakan sendiri saja ya)</p><p>Nur tahu, Bima suka kepada Widya hari itu.</p><p>Nur yang menghabiskan sebagian siangnya di dalam kamar, terbangun ketika Ayu memanggilnya.</p><p>semua anak sudah berkumplul, dan Ayu menunjukkan proposal proker mana saja yang sudah di setujui pak Prabu, dimana Ayu, membagi menjadi 3 kelompok, terlepas dari 1 proker kelompok</p><p>Widya dengan Wahyu, Nur dengan Anton, sementara Bima dengan Ayu.</p><p>semua anak sepakat, tidak ada yang komentar banyak, mengingat, Ayu yang paling berjasa sehingga bisa mendapatkan tempat KKN tanpa campur tangan pihak kampus.</p><p>lusa, adalah awal dari persiapan proker mereka.</p><p>sore datang, ketika Nur baru saja selesai merapikan barangnya untuk persiapan proker kelompok, Widya masuk ke kamar.</p><p>\"Nur, ados yok\" (Nur, mandi yuk)</p><p>\"nang ndi?\" (dimana?) tanya Nur,</p><p>\"nang Bilik sebelah kali, cidek Sinden kui loh, eroh kan awakmu, kolam cilik\"</p><p>(di bilik sebelahnya sungai, ada sebuah bilik kecil, tahu kan, yang bangunanya kaya kolam itu loh)</p><p>Nur, tidak menjawab. namun setelah memikirkan, bahwa ia belum membasuh badanya sejak pertama kali datang kesini, ia pun setuju. dengan syarat, Nur mau menjadi yang pertama mandi.</p><p>saat melewati Sinden, Nur sudah merasakan perasaan tidak nyaman, Sinden itu terdiri dari anak tangga yang di susun dengan batu bata merah, tampaknya bangunanya sudah sangat tua, ada air jernih di dalamnya, namun, Nur tidak pernah melihat ada yang menggunakan air itu.</p><p>selain itu, fokus Nur tentu pada bentuk menyerupai candi kecil di belakangnya, dan di pelataran candi, ada sesajen, hal yang sudah lumrah di tempat ini, hanya saja, Nur tidak melihat adanya gangguan saat ia mengamati Sinden itu.</p><p>sampailah mereka di bilik, yang di belakangnya ada pohon besar, pohonya rindang dengan rimbun semak di samping Bilik, Widya memberitahu Nur, bila di dalamnya ada kendi besar yang sudah di isi oleh warga dari sungai, dan memang untuk mandi anak-anak KKN.</p>','',NULL,'https://api.maba.my.id/storage/1/1603673216.jpg',NULL,NULL,NULL,1,NULL,1,0,152,1,1,NULL,NULL,'2020-10-25 09:46:56','2021-01-13 06:09:00',NULL),(6,1,'#part4 Cerita horor KKN di Desa Penari terus-menerus menjadi pembicaraan warganet. tanda pagar (tagar) #kkndesapenari, yang kini berubah menjadi #kkndidesapenari, masih menjadi trending topic di posisi teratas Aplikasi Maba untuk wilayah Indonesia.','<p>baru masuk, Nur langsung mencium aroma amis, seperti aroma daging busuk, namun Nur mencoba mengerti, mengingat Biliknya sendiri tidak terlihat seperti kamar mandi yang bersih, lantainya dari tanah, sedangkan kiri-kanan di penuhi lumut, jadi Nur mencoba memaklumi.</p><p>ia pun segera membasuh badanya dengan air di dalam kendi, namun, ada perasaan aneh ketika air membilas badanya, seperti ada benda kecil, yang mengganjal saat bersentuhan dengan kulit Nur.</p><p>ketika, di perhatikan dengan seksama, apa yang ada di dalam kendi, air itu di penuhi rambut</p><p>Nur kaget, istighfar terus menerus, sembari ia beringsut mundur, ia mencoba memanggil Widya. namun aneh, tidak ada jawaban apapun dari Widya.</p><p>Nur, dengan berselimut handuk, mencoba membuka pintu bilik, namun, pintu seperti di tahan oleh orang yang ada di luar.</p><p>\"Wid, bukak!! Wid bukak\" teriak Nur, sembari menggedor pintu anyam bambu itu.</p><p>namun, tetap tidak ada jawaban apapun dari Widya, sampai, Nur menyadari, di belakangnya, ada sosok Hitam itu, besar sekali, sampai menyentuh langit bilik.</p><p>Nur pun memejamkan mata rapat-rapat.</p><p>yang pertama ia lakukan adalah istighfar kencang-kencang, sembari tanganya mencari batu di tanah bilik, ketika tanganya berhasil meraih sebuah batu, Nur melemparkan kuat-kuat batu itu, sembari mengucap, doa yang di ajarkan gurunya bila bertemu lelembut, sampai, sosok itu lenyap,</p><p>butuh waktu untuk Nur menenangkan diri, ia tahu, ia sudah di incar, namun kenapa ia di incar, ia tidak melakukan apapun yang membuatnya di incar, bahkan bila karena ia secara tidak sengaja melihat makhluk itu, seharunya bukan hanya Nur yang sial, tapi makhluk itu juga sial.</p><p>tiba-tiba pintu terbuka, dimana Widya melihat Nur dengan ekspresi ganjil.</p><p>\"lapo Wid?\" (kenapa Wid?)</p><p>\"He?\" \"gak popo\" ucap Widya saat itu.</p><p>\"wes ndang adus, ben aku sak iki seng jogo, cepetan yo, wes peteng\" (ayo mandi, biar aku yang jaga, cepat ya, sudah mau malam)</p><p>awalnya Widya tampak ragu, ia seperti mau mengurungkan niatnya, tidak hanya itu, Widya seperti mau mengatakan sesuatu namun kemudian mengurungkanya, ia kemudian menutup pintu bilik.</p><p>ketika Nur, berjaga di luar, ia sayup-mendengar suara orang berkidung.</p><p>penasaran, Nur mulai mencari sumber suara, dan berakhir pada gemah dari dalam Bilik. takut, hal buruk terjadi, Nur mencoba memanggil Widya, menyuruhnya agar ia segera menyelesaikanya, namun, Widya tidak menjawab teriakanya, suara kidung itu, terdengar semakin jelas.</p><p>dari samping Bilik, ada semak belukar, Nur mencoba melempar batu darisana, namun, ia terperanjat saat tahu, dibelakang bilik ada sesaji, lengkap dengan bau kemenyan di bakar</p><p>Nur mencoba mengabaikanya, tetap berusaha memanggil sahabatnya, sampai, dari salah satu celah, ia melihat</p><p>yang didalam bilik, bukan Widya, namun sosok cantik jelita, siapa lagi bila bukan, si penari yang Nur lihat di malam kedatanganya di desa ini.</p><p>wanita cantik itu, membasuh badanya dengan anggun, sembari berkidung dengan suara yang membuat Nur tidak tahu harus berujar apa.</p><p>dimana Widya. pikir Nur, ia tidak menemukan sahabatnya, tidak dimanapun ia mencoba melihat.</p><p>sampai, sosok itu tersenyum seolah tahu, Nur melihatnya. lalu, ia bergerak menuju pintu, membukanya, dan saat itulah, Nur melihat Widya, keluar dengan wajah kebingungan,</p><p>selama diperjalanan pulang, Widya mencoba mengajak bicara Nur, namun, Nur tidak merespon ucapan Widya, ia memikirkan apa yang barusaja ia lihat bukan hal kebetulan semata. seperti sebuah pesan,</p><p>pesan apa?</p><p>Widya dalam bahaya, atau, dirinya yang sedang dalam bahaya.</p><p>Malam setelah sholat Isya, Nur berpamitan sama Ayu dan Widya, ia ingin menemui pak Prabu, untuk pengajuan proposal prokernya bersama Anton.</p><p>Ayu sempat bertanya pada Nur, apakah Anton menemani, namun Nur mengatakan, ia bisa sendiri, meski Ayu menawarkan diri, namun Nur menolaknya</p><p>ada hal yang mau di luruskan, bukan prokernya, namun apa yang sebenarnya terjadi disini, pak Prabu tahu sesuatu. setidaknya itu asumsi Nur.</p><p>dan, ia merasa harus bertemu beliau malam ini, seakan-akan ada yang membisikinya bahwa, ia harus pergi ke rumah pak Prabu.</p><p>benar saja. pak Prabu duduk di teras rumah, seakan-akan, beliau sudah menunggunya. namun, ada sosok lain yang duduk bersamanya, seorang lelaki renta, ia duduk, sembari mengisap bakau lintingan, dan ketika Nur datang, si lelaki tua, tersenyum seperti mengenalinya.</p><p>Nur mendekat, memberi salam, pak Prabu tersenyum ramah seperti biasanya, lalu mempersilahkan Nur duduk, namun, Nur lebih tertuju pada 3 gelas kopi yang tersaji.</p><p>\"niki tiang\'e ten pundi to pak, kopi\'ne kelebihan setunggal??\" (ini yang punya kemana ya pak, kopinya kelebihan satu?)</p><p>\"iku kopi, gawe awakmu, cah ayu\" (itu kopi untuk kamu, mbak yang cantik) ucap lelaki renta itu. ia masih tersenyum, memandang Nur.</p><p>\"ngapunten mbah, kulo mboten ngopi\" (mohon maaf kek, saya tidak minum kopi)</p><p>\"wes ta lah, di ombe sek, gak oleh nolak paringane tuan rumah nang kene yo. gak apik\" (sudahlah, di minum dulu, gak baik nolak pemberian tuan rumah disini. tidak bagus pokoknya)</p><p>\"nggih pak\" ucap Nur</p><p>ketika Nur menyesap kopinya, aneh, kopi itu terasa seperti aroma melati, rasanya manis, dan ia tidak menemukan ampas, padahal dari luar, kopi itu terlihat seperti kopi hitam yang sekali lihat, bisa di rasakan rasanya akan sepahit apa.</p><p>si kakek bertanya. \"yo opo rasane?\"</p><p>\"Enak mbah\"</p><p>si mbah mengangguk puas, kemudian bertanya kembali. \"sak iki ceritakno, onok opo, cah ayu mrene?\" (sekarang, kamu boleh cerita, kenapa kamu kesini anak cantik?)</p><p>\"kulo bade tandet ten pak Prabu mbah\" (saya mau tanya sama pak Prabu kek)</p><p>\"takon perkoro\" (tanya soal)</p><p>\"kulo di ketok\'e memedi sing gedeh mbah, kulo wedi mbah, nganggo salah ten mriki, ngapunten nek kulo enten salah nang njenengan warga mriki\" (saya di ikuti oleh sosok besar kek, saya takut. apa saya sudah melakukan kesalahan, sehingga saya dikejar, apa ada yang saya perbuat-</p><p>-dan membuat tidak nyaman warga sini, saya minta maaf sebesar-besarnya)</p><p>saat itulah, pak Prabu bicara</p><p>\"ndok, guk salahmu kok, sing ngetutke awakmu, iku ngunu, gak nyaman, mbek sing mok gowo\" (nak, ini bukan salahmu, alasan kenapa kamu diikuti, karena kamu bawa sesuatu dari luar)</p><p>\"maksude yok nopo pak, kulo mboten ngetos maksud njenengan\" (maksudnya bagaimana pak, saya tidak mengerti maksud anda)</p><p>si kakek, kemudian melanjutkan. \"awakmu ndok, iku ngunu, onok sing njogo, yo. sopo?? mbah dok, nah, iku sing gak di terimo nang kene. ngerti ndok\"</p><p>(kamu itu nak, ada yang menjaga, siapa ya? nenek-nenek, nah, itu yang tida diterima disini. paham nak)</p><p>\"kulo, njogo? ngapunten, kulo mboten paham\" (saya, menjaga. mohon maaf, saya belum mengerti)</p><p>\"wes, ngene ae, mene bengi, mampir rene maneh yo, tak duduno sesuatu\"</p><p>(sudah begini saja, besok malam, kamu kesini, saya tunjukkan sesuatu sama kamu)</p><p>meski tidak mengerti maksud ucapan pak Prabu dan lelaki renta itu, Nur akhirnya kembali ke penginapanya. dengan membawa nama lelaki renta itu, yang menyebut dirinya dengan nama \"Mbah Buyut\"</p><p>yang pertama Nur lihat saat ia menginjak penginapan adalah, Widya. ia seperti sudah menunggunya, dan benar saja, Widya mengajukan pertanyaan aneh-, seperti darimana, kenapa tidak minta di temenin, namun, Nur tidak ingin menceritakanya, ia takut bila Widya dan yang lain terlibat.</p><p>Nur langsung pergi ke kamar, beristirahat, meski pikiranya masih menerawang jauh, ia tidak tahu harus melakukan apa selain menyimpanya sendiri.</p><p>berharap mendapatkan ketenangan dalam tidurnya, Nur malah mendapat mimpi, tak terlupakan, sepeti sebuah pesan untuknya.</p><p>di mimpi itu, Nur melihat sebuah tempat, banyak pepohonan yang tumbuh, salah satu yang tidak akan pernah Nur lupakan adalah pohon Jati kroyo atau lebih dikenal dengan nama jati belanda yang tumbuh di sepanjang mata memandang, bukan hanya itu, ada rimbun tumbuh tanaman beluntas.</p><p>aroma dedaunan beluntas yang wangu, membuat Nur mengingat kembali saat ia masih tinggan di pesantren, namun, Nur sadar, bahwa ia saat ini, berdiri di tengah hutan belantara, sendirian, dengan kegelapan malam yang menyiutkan nyalinya. Nur, mulai berjalan, menyusuri tanah lapang</p><p>sejauh mata memandang, Nur hanya melihat pepohonan yang besar diselimuti kabut keputihan, tepat ketika Nur tengah berjalan, ia mendengar riuh sorai dari kejauhan, dari suara itu, terdengar ramai orang, entah ada apa, sehingga keramaian itu, membuat Nur penasaran, ia pun mendekati</p><p>semakin mendekati sumber suara, Nur merasa janggal, entah apakah dari balik pepohonan atau semak belukar, ada yang tengah mengasinya, Nur hanya mengucap kalimat yang bisa menguatkan batinya, bahwa ia, disini, bukan berniat menganggu.</p><p>\"mbah, ngapunten, cucu\'ne numpang lewat, mboten gada niat nganggu. ngapunten nggih mbah\" (mbah, mohon maaf, cucu\'mu hanya ingin lewat, tidak ada keinginan mengganggu, mohon maaf ya mbah)</p><p>kalimat itu, terus Nur, ucapkan. dan, sampailah, ia, di keramaian itu.</p><p>banyak sekali orang, mulai dari yang tua, hingga yang muda, dari anak-anak sampai remaja, mereka semua berkumpul menjadi satu, didepan sebuah sanggar besar, ada alunan musik gamelan, yang mengalun merdu, tepat, ditengah sanggar, ada sosok penari yang sangat cantik.</p><p>Nur, tidak pernah tahu, ada tempat seperti ini di desa ini, sebelumnya, ia memang tidak mengikuti pak Prabu saat mengajak semua rombongan temanya berkeliling kampung, maka, saat itu, Nur hanya berpikir, di tempat inilah, warga kampung mengadakan hajatan.</p><p>Nur masih belum menyadari, kenapa dan bagaimana ia bisa sampai disana, yang ia tahu, ia tersesat sampai akhirnya berakhir ditempat ini</p><p>ketika, Nur tengah asyik menikmati pertunjukkan itu, tiba-tiba, terdengar sayup seseorang berteriak, anehnya, hanya Nur yang merasa mendengarnya</p><p>teriakanya pilu, meminta tolong, Nur pun meninggalkan keramaian itu, matanya awas, mencari sumber suara yang meminta tolong itu, naas, ketika Nur tengah berjalan, ia terpelosok jatuh dari sebuah bukit yang tidak terlalu tinggi, mencoba bangkit, Nur melihat kakinya mati rasa.</p><p>saat itulah, Nur melihatnya.</p><p>seekor ular tengah menatapnya, ia mendesis, membuat Nur hanya bisa terpaku melihatnya.</p><p>sisiknya hijau zambrud, meski ukuranya tidak terlalu besar, ular itu cukup membuat Nur ketakutan, dengan tenaga yang tersisa, Nur merangkak menjauhinya.</p><p>masalahnya, adalah, setelah itu, muncul orang yang Nur kenal, sosok yang berjalan mendekati Nur, Widya,</p><p>Widya memeluk ular itu, seperti peliharaanya, membiarkan ular itu, melilit lenganya, seakan-akan ular itu adalah temanya.</p><p>melihat itu, Nur tidak tahu harus bicara apa</p><p>karena setelah itu, Nur tersentak dari tidurnya setelah mendengar suara bising dari luar rumah.</p><p>meski masih dalam keadaan shock, Nur segera berlari menuju suara bising itu, rupanya, di luar rumah, ramai orang tengah berkumpul.</p><p>Nur melihat, Wahyu, Ayu, ibu pemilik rumah, Widya</p><p>entah apa yang mereka lakukan, Nur belum mengerti sama sekali.</p><p>yang ia dengar hanya ucapan ibu pemilk rumah.</p><p>\"Wes, wes, ayo ndok, melbu ndok, wes bengi\" (sudah, sudah, ayo masuk, sudah malam)</p><p>namun, ketika mata Nur dan Widya bertemu, ada tatapan kebingungan disana.</p><p>Wahyu kembali ke posyandu tempat ia menginap, sementara si ibu pemilik rumah, menggandeng Widya masuk ke rumah, hanya tinggal Ayu dan Nur yang ada di luar rumah.</p><p>\"onok opo toh yu, kok rame men?\"</p><p>(ada apa sih yu, kok berisik sekali?)</p><p>\"Wahyu. jarene ndelok Widya nari nang kene. mboh lapo, aku yo kaget pas ndelok, gak onok Widya nang kamar\" (Wahyu, bilang, melihat Widya sedang menari disini, entahlah kok bisa, aku juga kaget waktu melihat Widya tidak ada didalam kamar)</p><p>Nur yang mendengar itu, hanya diam, sembari memikirkan mimpinya.</p><p>Widya, hanya itu yang terbesit dalam pikiranya Nur. ia tahu, ada yang janggal dari dirinya, Widya dan tempat ini.</p><p>keesokan hari. sesuai janji yang Nur buat, ia bertemu dengan mbah Buyut dengan pak Prabu, kali ini, Nur di ijinkan masuk ke dalam rumahnya.</p><p>yang mbah Buyut pertama ucapkan adalah \"ndok, mambengi ngimpi opo?\" (nak, semalam kamu mimpi apa?)</p><p>Nur pun menceritakan semuanya, termasuk insiden saat ia melihat Widya yang di pergoki Wahyu tengah menari di malam buta.</p><p>mbah buyut hanya mengangguk, tidak berbicara apapun, ia hanya berujar, bahwa, yang ingin di ketahui Nur, adalah sosok hitam yang mengikutinya.</p><p>Malam itu juga, pak Prabu, mbah Buyut, dan Nur pergi ke sebuah batu, tempat pertama kali Nur melihat sosok hitam itu.</p><p>disana, pak Prabu, menggorok seekor ayam, dimana darahnya di tab di sebuah wadah, sebelum menyiramkanya di batu itu.</p><p>\"ndok, awakmu percoyo, nek gok alas iki, onok deso maneh, sing jenenge Deso Brosoto\" (nak, kamu percaya, di hutan ini, ada desa lain yang namanya desa halus)</p><p>Nur mengangguk, ia percaya.</p><p>Mbah Buyut tersenyum, \"sing bakal mok delok iki, siji tekan atusan ewu wargane deso iku\"</p><p>(yang akan kamu lihat sebentar lagi, itu satu dari ratusan ribu penghuni dari desa tersebut)</p><p>Nur terdiam mendengarnya, dan benar saja, ia bisa meihat makhluk hitam itu, tengah menjilati batu yang baru di guyur darah ayam kampung itu.</p><p>Makhluk itu, hanya menjilati darah itu, kemudian, pak Prabu mengatakanya.</p><p>\"awakmu sadar utowo gak, asline, awakmu gowo barang alus sing di anggap tamu nang deso iki, coro alus\'e ngunu yo ndok\" (kamu sadar atau tidak, sebenarnya, membawa tamu ke desa ini, cara gampangnya gitu)</p><p>\"tamu sing mok gowo, iku ngunu seneng ngejak geger ambeh warga deso iki\" (tamu yang kamu bawa itu, suka sekali membuat masalah di desa ini)</p><p>\"masalahe, sing mok gowo iku wes di kunci nang njero Sukmo\'mu, nek di jopok, awakmu isok mati\" (masalahnya, barang itu sudah terikat di-</p><p>sukma kamu, bila di ambil, bisa mati)</p><p>\"aku wes ngerembukno karo mbah Buyut, nek barangmu gak usah di jopok, tapi, di culno, selama awakmu masih onok nang kene, barangmu kepisah ambek awakmu\"</p><p>(aku sudah berunding sama mbah Buyut, bila apa yang ada dalam diri kamu, gak usah-</p><p>diambil, tapi di lepaskan saja, selama kamu masih disini, dia tidak akan pergi jauh)</p><p>\"barang nopo to mbah?\" (barang seperti apa?)</p><p>Mbah Buyut mendekati Nur, sebelum, menarik ubun-ubunya, kemudian melemparkanya ke batu itu.</p><p>setelah itu, Nur, tidak bisa melihat makhluk hitam itu lagi.</p><p>\"wes mari ndok, sak iki, awakmu isok fokus garap tugasmu, gak bakal onok sing nganggu maneh\" (sudah selesai nak, sekarang, kamu bisa fokus garap tugasmu, gak akan ada yang ganggu kamu lagi)</p><p>Siang itu, Nur dan Anton, tengah mengerjakan proker mereka bersama warga desa, ketika hari sudah siang, ia tanpa sengaja melihat Widya dan wahyu, serta pak Prabu dan Ayu tengah mengendarai motor, mereka pergi meninggalkan desa, entah kemana.</p><p>\"Nur, kancamu iku loh kok aneh seh\" (Nur, temanmu itu kok aneh sih) tiba-tiba, Anton mengatakan itu</p><p>\"aneh? sopo?\" (aneh, siapa?)</p><p>\"sopo maneh, kancamu, Bima\" (siapa lagi, temanmu, si Bima)</p><p>\"aneh yo opo?\" (aneh bagaimana?)</p><p>\"aku gelek ndelok cah kui ngomong dewe, ngguya-ngguyu dewe nang kamar, trus, sepurane yo Nur, aku tau ndelok arek\' Onani\" (aku sering melihat anak itu bicara sendiri, tersenyam-senyum di kamar, bahkan, aku pernah melihatnya, mohon maaf ya Nur, anak itu Onani dalam kamar)</p>','',NULL,'https://api.maba.my.id/storage/1/1603673346.jpg',NULL,NULL,NULL,1,NULL,2,0,161,2,1,NULL,NULL,'2020-10-25 09:49:06','2021-01-13 06:08:09',NULL),(7,1,'#part5 Cerita horor KKN di Desa Penari terus-menerus menjadi pembicaraan warganet. tanda pagar (tagar) #kkndesapenari, yang kini berubah menjadi #kkndidesapenari, masih menjadi trending topic di posisi teratas Aplikasi Maba untuk wilayah Indonesia.','<p>Nur yang mendengar itu tidak bereaksi apapun, hanya berucap\"halah, gak mungkin lah\" seakan apa yang dikatakan Anton hanya gurauan.</p><p>\"temen? sumpah!!\" (serius? beneran!!)</p><p>\"ambek, ojok ngomong sopo-sopo yo, temen yo, tak kandani?\" (sama, tapi janji jangan bilang siapa-siapa ya)</p><p>\"kancamu kui, gelek gowoh muleh sesajen, trus, di deleh nang nisor bayang\'e,\" (temanmu itu, sering membawa pulang sesajen, trus dia menaruh benda itu di bawah ranjang)</p><p>Nur masih mencoba menahan diri, ia masih tidak bereaksi mendengar Bima di tuduh seperti itu oleh Anton.</p><p>namun, seketika emosi Nur tak terbendung saat Anton mengatakan itu.</p><p> </p><p>\"trus, nang ndukur Sesajen iku, onok fotone kancamu, Widya, opo, Bima kate melet Widya yo\" (trus, di atas sesajen itu, aku menemukan foto temanmu, Widya, apa, Bima mau pelet si Widya ya)</p><p>\"awakmu gor di jogo yo lambene, ojok maen fitnah yo\" (kamu itu, tolong di jaga mulutnya, jangan maen fitnah seperti ini)</p><p>\"nek awakmu gak percoyo, ayok tak jak nang kamare, ben awakmu ndelok, nek aku gak mbujuk\" (kamu kalau gak percaya ayo sini ikut, tak tunjukkan kalau aku-</p><p>tidak pernah berbohong)</p><p>mendengar Anton menantang seperti itu, saat itu juga, Nur mengikuti Anton yang tengah berjalan menuju tempat mereka menginap.</p><p>seketika Nur tidak bisa berbicara apa-apa saat melihat itu di depan mata kepalanya sendiri, seperti Nur ingin menghantam kepala Bima saat itu juga. ia tidak pernah tahu, Bima segila ini.</p><p>teman sepondok pesantrenya jadi seperti ini.</p><p>\"aku wani ngajak awakmu awan ngene soale aku apa nek ngene iki, Bima nang kebon kaspe ambek Ayu, nggarap proker\'e, gak masalah opo-opo, tapi, asline aku wedi yu, ben bengi, aku krungu suoro arek wedok nang kene\"</p><p>(alasan kenapa aku berani ngajak kamu kesini karena aku tahu, si Bima dan Ayu pasti sekarang garap prokernya di kebun ubi, bukan masalah apa-apa sih, tapi sebenarnya aku takut, setiap malam, aku dengar suara perempuan disini)</p><p>ucapan Anton yang terakhir, membuat Ayu tidak dapat bicara lagi, saat ia, termenung sendiri, entah kenapa, insting Nur, mengatakan ada yang di sembunyikan oleh temanya.</p><p>\"sopo sing nang kamar ambek Bima?\" (siapa yang ada dikamar sama Bima?)</p><p>\"yo iku masalahne\" (itu masalahnya)</p><p>\"ben tak enteni cah iku metu, gak onok sing metu takan kamare\" (setiap tak tungguin, tidak ada yang keluar dari kamarnya)</p><p>Nur, tiba-tiba mendekati almari, ia merasa mendengar sesuatu disana. tepat ketika, almari itu terbuka, Nur dan Anton tersentak kaget saat melihat, ada ular didalamnya.</p><p>Ular itu berwarna hijau, kemudian lenyap setelah melewati jendela posyandu.</p><p>Anton dan Nur hanya saling menatap satu sama lain, tidak ada hal lagi yang harus mereka bicarakan.</p><p>semenjak saat itu, Nur selalu mengawasi Bima, bahkan ketika akhirnya pak Prabu tiba-tiba mengatakan bahwa mereka semua akan tinggal satu atap, meski terpisah dengan sekat. dari situ juga, Nur jadi lebih tahu, Bima seringkali mengawasi Widya tanpa sepengetahuan siapapun</p><p>yang paling tidak bisa Nur lupakan adalah, saat ia bertanya perilah kenapa ia jarang melihat Bima sholat lagi. Bima selalu berdalih, tidak ada alasan kenapa ia harus mengatakan pada orang saat ia beribadah.</p><p>meski Bima selalu bisa membalik pertanyaan Nur, ia tahu, Bima berbohong</p><p>puncaknya, ketika itu, sore hari, Nur barusaja selesai sholat asar di dalam kamar, tiba-tiba, ia mendengar suara bising dari samping kamar, Nur pun beranjak, mencari sumber suara.</p><p>manakala ketika ia mencari, ia melihat Bima, sedang menabur sesuatu di tempat dimana Widya</p><p>biasa duduk.</p><p>Nur, yang selalu membersihkan bunga-bungaan itu. aneh, namun kelakukan Bima semakin membuat Nur penasaran.</p><p>namun, masalah tidak hanya berhenti di Bima saja, melainkan sahabatnya Widya.</p><p>setelah maghrib, Nur pergi ke dapur untuk minum, saat, ia melihat Widya-</p><p>menatapnya.</p><p>wajahnya kaget dan bingung melihat Nur, \"lapo Wid?\" tanya Nur yang juga kaget dan bingung.</p><p>mata mereka saling bertemu, namun, hanya untuk saling mengamati satu sama lain.</p><p>ketika Nur mendekati Widya, tiba-tiba Widya berlari ke kamar, lalu kembali menemui Nur, matanya tampak seperti barusaja melihat setan.</p><p>\"onok opo toh asline?\" (ada apa sih sebenarnya?) tanya Nur.</p><p>Nur melihat tangan Widya sampai gemetaran,</p><p>Nur tidak tahu, kenapa Widya menjadi seperti ini, sampai pertanyaan Ayu, membuat Nur terhenyak dan menyadari anak-anak semua berkumpul disana.</p><p>\"ramene, onok opo toh\" (ramai sekali, ada apa sih) tanya Ayu.</p><p>\"gak eroh, cah iki, di jak ngomong ket mau, meneng tok\" (tidak tahu, anak ini, di ajak ngomong diam saja daritadi)</p><p>\"lapo Wid?\" (kenapa Wid?) tanya Wahyu yang mendekati.</p><p>\"tanganmu kok sampe gemetaran ngene, onok opo seh asline?\" (tanganmu kok sampai gemetar begini, ada apa?)</p><p>kata Anton tidak kalah penasaran.</p><p>\"Nur jupukno ngombe kunu loh, kok tambah meneng ae\" (Nur ambilkan air minum gitu loh, kok malah diam saja)</p><p>kaget mendengar teguran Anton, Nur lalu mengambil teko air, dan memberikanya pada Widya, disini hal mengerikan itu terjadi..</p><p>ketika Widya meneguk air dari teko yang sama dengan teko yang Nur minum tadi, tiba-tiba Widya berhenti meneguknya, membiarkan air itu berhenti di dalam mulutnya, lantas, Widya kemudian memasukkan jemarinya ke dalam mulut, dan darisana, keluar berhelai-helai rambut hitam panjang.</p><p>Nur dan yang lainya terperangah manakala Widya menarik sulur rambut itu dengan tanganya, tidak ada yang bisa berkomentar,</p><p>lalu, Widya memeriksa isi teko, disana, semua orang melihat, didalamnya, ada segumpal rambut hitam panjang didalamnya.</p><p>insiden itu membuat Widya memuntahkan isi perutnya, di tengah ketegangan itu, Anton tiba-tiba berucap \"Wid, awakmu di incer ya, nek jare mbahku, lek onok rambut gak koro metu, iku nek gak di santet yo di incer demit\"</p><p>(Wid, ada yang ngincar kamu ya, kalau kata kakekku, bila tiba- keluar rambut entah darimana, biasanya kalau tidak di santet ya di incar setan)</p><p>ucapan Anton, membuat suasana semakin tidak kondusif, ditengah kepanikan itu, tiba-tiba Nur, teringat dengan sosok penari yg ia lihat</p><p>\"Wid, opo penari iku jek ngetutno awakmu, soale ket wingi, aku gorong ndelok nang mburimu maneh\" (Wid, apa penari itu masih mengikuti kamu, soalnya dari kemarin, aku belum melihatnya lagi) ucapan spontan Nur, membuat semua orang mengerutkan dahi, sehingga Nur akhirnya diam.</p><p>setelah kejadian itu, Nur merasa bersalah, sehingga ia mencoba menjauhi Widya, disini, tanpa sengaja, Nur mencuri dengar suara seseorang yang tengah berteriak satu sama lain</p><p>Nur terdiam untuk mendengarkan</p><p>rupanya, suara itu berasal dari Ayu dan Bima,</p><p>untk apa mereka berkelahi</p><p>ada satu kalimat yang paling di ingat oleh Nur, adalah, kalimat ketika Bima mengatakan.</p><p>\"nang ndi Kawaturih sing tak kek\'no awakmu, aku kan ngongkon awakmu ngekekno nang Widya seh!!! kok arek\'e gorong nerimo iku!!\"</p><p>\"dimana mahkota putih yang aku serahkan sama kamu-</p><p>aku kan sudah nyuruh kamu memberikanya kepada Widya!! kok dia belum nerima benda itu!!\"</p><p>Nur tidak memahami maksud mahkota putih itu, namun, Nur mengerti, ada sesuatu, diantara mereka.</p><p>semenjak kejadian itu. Nur merasa, firasatnya semakin buruk, di mulai dengan suara berbisik dari warga.</p><p>banyak warga yang mengeluhkan bahwa proker Ayu dan Bima adalah proker yang paling banyak di tentang, namun Nur belum paham alasan kenapa di tentang.</p><p>sampai Anton memberitahu.</p><p>\"Bima, kancamu kui, kate gawe rumah bibit, nang nduwor Tapak tilas, yo jelas di tentang, wong enggon iku keramat\" (temanmu si Bima, dia mau buat rumah bibit, di jalan tapak tilas, tentu saja banyak yang gak terima, itu tempat di keramatkan)</p><p>Nur masih belum mengerti maksud Anton.</p><p>\"tapak tilas, nggon opo iku, kok sampe di larang, kan bagus proker\'e gawe kemajuan desa iki\" (Tapak tilas itu tempat apa, kok sampai di larang, kan bagus proker mereka untuk kemajuan desa ini) ucap Nur,</p><p>\"yo aku gak eroh, wong, di larang kok\" (ya aku mana tau, pokoknya di larang)</p><p>\"nang ndi seh, nggon iku, kok aku gak eroh, awakmu isok ngeterno aku gak?\" (dimana sih tempatnya, kok aku gak tau, kamu bisa antarkan aku kesana) ucap Nur penasaran</p><p>\"Lha matamu, gendeng\'a wong pak Prabu ae mewanti ojok sampe melbu kunu, iku ngunu langsung alas\"</p><p>(lha, matamu, gila aja, pak Prabu sendiri melarang masuk kesana, itu tempat langsung ke hutan belantara)</p><p>namun, Nur masih penasaran, sehingga ia tetap bersikeras mau kesana, jadi ia bertanya pada Anton meski dengan mengatakan bahwa ia bertanya untuk menghindari tempat itu.</p><p>Anton, setuju. ia memberitahu ancer (letak) tempat itu berada, yang ternyata adalah lereng bukit dengan satu jalan setapak ke atas, di sampingnya, memang adalah perkebunan ubi tempat Bima dan Ayu melaksakan proker, namun, sore itu, 2 anak itu tidak ada disana. entah kemana.</p><p>setelah selesai memberitahu, Anton mengajak Nur pergi darisana, namun, Nur mengatakan, sore ini ada janji temu dengan pak Prabu, jadi jalan mereka akan berpisah disini. meski awalnya Anton curiga, namun akhirnya ia percaya dan pergi.</p><p>setelah Anton pergi, Nur menatap tempat itu</p><p>ia menatap lama, gapura kecil, sama seperti yang lain, ada sesajen disana, tidak hanya itu, gapura itu di ikat dengan kain merah dan hitam, yang menandakan bahwa tempat itu sangat di larang, namun, insting rasa penasaranya sudah tidak tertahankan lagi, seperti memanggil.</p><p>jalanya menanjak dengan sulur akar dan pohon besar disana-sini, butuh perjuangan untuk naik, namun anehnya, jalan setapak ini seperti sengaja di buat untuk satu orang, sehingga jalurnya mudah untuk di telusuri, menyerupai lorong panjang dengan pemandangan alam terbuka.</p><p>Nur menyusuri tempat itu, langit sudah berwarna orange, menandakan hanya tinggal beberapa jam lagi, petang akan datang.</p><p>meski tidak tahu apa yang Nur lakukan disini, namun perasaanya seolah terus menerus mendesaknya untuk melihat ujung jalan setapak ini, kemana ia membawanya.</p><p>angin berhembus kencang, dan tiap hembusanya, membawa Nur semakin jauh masuk ke dalam, ia tidak akan bisa keluar dari jalan setapak karena rimbunya semak belukar dengan duri tajam yang bisa menyayat kulit dan kakinya.</p><p>namun, ia semakin curiga, semakin masuk, sesuatu ada disana</p><p>tetapi, ia harus kecewa, ketika di ujung jalan, bukan jalan lain yang ia lihat, namun, semak belukar dengan pohon besar menghadang Nur, di bawahnya di tumbuhi tanaman beluntas yang rimbun, jalan ini, tidak dapat di lewati lagi.</p><p>lalu, kenapa tempat ini seolah di keramatkan.</p><p>apa yang membuat tempat ini begitu keramat bila hanya sebuah jalan satu arah seperti ini.</p><p>langit sudah mulai petang, Nur bersiap akan kembali, tetapi, langkahnya terhenti saat ia merasa ada hembusan angin dari semak beluntas di depanya, ia pun, menyisir semak itu, sampai..</p><p>Nur melihat sebuah undakan batu yang di susun miring, ia tidak tahu, rupanya ia berdiri di tepi lereng bukit, meski awalnya ragu, Nur akhirnya melangkah turun, menjajak kaki dari batu ke batu sembari berpegang kuat pada sulur akar di lereng, ia sampai di bawah dengan selamat</p><p>seperti dugaanya, ada tempat tak terjamah di desa ini, manakala Nur melihat dengan jelas, sanggar atau bangunan yang lebih terlihat seperti balai sebuah desa, namun, kenapa tempat ini tidak terawat.</p><p>Nur berkali-kali melihat langit, hari semakin gelap, namun, ia justru mendekat</p><p>layaknya sebuah tanah lapang dengan bangunan atap yang bergaya balai desa khas atap jawa, Nur mengamati tempat itu setengah begidik.</p><p>selain kotor dan tak terurus, tidak ada apapun disini, kecuali, sisi ujung dengan banyak gamelan tua tak tersentuh sama sekali.</p><p>butuh waktu lama untuk Nur mengamati tempat ini sampai ia mengambil kesimpulan, tempat ini sengaja di tinggalkan begitu saja, kenapa?</p><p>ia menyentuh alat musik kendang, mengusapnya, dan semakin yakin, tempat ini sudah sangat lama di tinggalkan.</p><p>setiap Nur menyentuh alat-alat itu, ia merasa seseorang seperti memainkanya, ada sentuhan kidung di telinganya. Nur sendirian, namun, ia merasa, ia berdiri di tengah keramaian.</p><p>kegelapan, sudah menyelimuti tempat itu, langit sudah membiru, namun. Nur merasa tugasnya belum selsai</p><p>sampai, Nur tersentak oleh sebuah suara Familiar yang memanggil namanya,</p><p>ketika Nur berbalik menatap sesiapa yang baru saja memanggilnya, Nur mematung melihat Ayu, berdiri dengan muka tercengang, dari belakang, muncul Bima, tidak kalah tercengang</p><p>suasana menjadi sangat canggung</p><p>\"yu, Bim? kok nang kene?\" (yu, bim, kok kalian ada disini?)</p><p>Ayu dan Bima hanya mematung, tidak menjawab pertanyaan Nur sama sekali, hal itu, membuat Nur mendekati mereka, melewatinya dan kemudian ia melihat ada sebuah gubuk di belakang bangunan ini.</p><p>Nur berbalik, ia kecewa</p><p>\"Bim, abah karo umi nek eroh kelakukanmu yo opo yo, sebagai konco, aku gak nyongko loh Bim\" (Bim, Abah sama Umi kalau tahu perbuatanmu gimana ya, sebagai temamu lama, aku tidak menyangka hal ini sama sekali)</p><p>Bima hanya diam, Ayu, apalagi.</p><p>\"Nur, tolong\" ucap Ayu, menyentuh lengan Nur,</p><p>\"aku gak ngomong mbek koen yu, aku ngomong karo Bima\" (aku gak bicara sama kamu yu, aku mau bicara sama Bima)</p><p>tatapan Nur membuat Ayu beringsut mundur, Bima masih diam, sebelum Nur akhirnya menggampar tepat di pipinya Bima.</p><p>\"wes ping piro?\" (sudah berapa kali?) tanya Nur.</p><p>\"pindo\'ne\" (kedua kalinya)</p><p>Nur tidak tahu harus berucap apa, \"sek ta lah, opo sing jare Anton nek krungu suara cah wadon gok kamarmu iku koen ambek Ayu!!\" (tunggu, ini artinya, apa yang dikatakan Anton soal dia dengar suara-</p><p>-perempuan di kamarmu itu kamu sama ayu!!)</p><p>namun, Bima menatap wajah Nur dengan kaget, tidak hanya itu, Ayu juga terperangah tidak percaya, kemudian menatap Bima dengan sengit, seakan Nur salah bicara.</p><p>\"maksude Nur?\" (maksudnya Nur?!) tanya Ayu kaget.</p><p>\"Bim, ojok ngomong awakmu!!\" (Bim jangan bilang kamu!!)</p><p>\"wes wes, ayo mbalik, engkok tak ceritakno kabeh, tulung, ojok ngomong sopo sopo dilek yo Nur\" (sudah, ayo kembali dulu, nanti tak ceritakan semua, tolong jangan ngomong ke siapa2 dulu, ya Nur)</p><p>Nur, Ayu dan Bima pergi.</p><p>wajah Bima tegang, seakan-ia di kejar sesuatu, hingga akhirnya ia keluar dari tempat itu, langit sudah gelap gulita, dan Nur, merasa ada yang mengikuti mereka semua.</p><p>setelah sampai di rumah, Nur meminta Bima dan Ayu berkumpul di belakang rumah, sementara Anton menyesap rokok di teras, sedangkan Wahyu dan Widya, belum juga pulang, mereka tidak tahu masalah ini, karena Nur merasa hal ini memang tidak seharusnya di ketahui semua orang.</p><p>\"sak iki ceritakno kok iso\'ne kanca KKN dewe loh di garap ngene\" (sekarang ceritakan, saya mau dengar, kok bisa ya, teman KKN di hajar seperti ini) kata Nur, Ayu masih diam, ia memikirkan ucapan Nur yang tadi, Bima mulai berbicara.</p><p>\"khilaf aku Nur\" kata Bima, seakan apa yang di ucapkan dari mulutnya terdengar sepele,</p><p>\"gak isok nek ngunu, bakal tak gawe rame masalah iki ambek keluargamu, lanang iku kudu wani tanggung jawab ambek perbuatane\" (tidak bisa seperti itu, akan ku buat ramai nanti sama keluargamu-</p><p>laki-laki harus berani bertanggung jawab atas perbuatanya)</p>','',NULL,'https://api.maba.my.id/storage/1/1603673514.jpg',NULL,NULL,NULL,1,NULL,2,0,165,2,1,NULL,NULL,'2020-10-25 09:51:54','2021-01-13 06:08:09',NULL),(8,1,'#part6 Cerita horor KKN di Desa Penari terus-menerus menjadi pembicaraan warganet. tanda pagar (tagar) #kkndesapenari, yang kini berubah menjadi #kkndidesapenari, masih menjadi trending topic di posisi teratas Aplikasi Maba untuk wilayah Indonesia.','<p>Ayu yang sedari tadi diam, kemudian bicara. \"Nur, tolong, ojok di gawe rame disek, yo opo engkok reaksine warga, pak prabu, utowo arek2\" (Nur, tolong, jangan di buat ramai dulu, gimana coba reaksi semua orang) ucap Ayu</p><p>\"aku bakal tanggung jawab Nur, muleh tekan kene, Ayu bakal tak rabi Nur\" (aku akan tanggung jawab, Ayu akan saya nikahi habis pulang darisini)</p><p>\"goblok ya wong loro iki, dipikir masalah iki mek masalah mu tok tah, gak mikir aku, gak mikir Widya, gak mikir liane, gak mikir-</p><p>-jeneng kampusmu, gak mikir keluargamu, gak mikir agamamu, nek ngomong mu mek ngunu, penak yo, kari rabi tok, gak iling opo iku karma yo\"</p><p>(goblok ya kalian, di kira ini masalah sepele, gak mikir aku, gak mikir Widya, gak mikir yang lain, gak mikir nama kampusmu, gak mikir-</p><p>keluargamu, kalau memang cuma masalah pernikahan ya enak ya, tapi kalian lupa dengan yang namanya karma tabur tuai)</p><p>Ayu yang mendengar itu perlahan sesenggukan, Nur tahu, ia menangis, namun Bima, ia seperti menyembunyikan sesuatu. ada yang belum ia jelaskan sama sekali.</p><p>Anton tiba-tiba muncul sembari mengatakan, \"cah loro iku wes teko, mboh tekan ndi, mosok moleh sampe bengi ngene\" (itu loh, dua temanmu sudah datang, entah darimana, masa pulang sampai larut begini)</p><p>\"Widya karo wahyu ton?\" (Widya sama wahyu ya ton)</p><p>Anton mengangguk. \"iyo\"</p><p>Nur melihat Widya, wajahnya tampak letih, sperti barusaja mengalami kejadian tidak mengenakan, semua orang sudah menunggu kedatangan dua anak ini, yg berjanji akan membelikan keperluan titipan mereka, namun, dari belakang, Wahyu tampak sangat bersemangat seakan ia membawa sesuatu</p><p>entah karena suasana hati semua orang buruk di ruangan itu, Bima mencoba mencairkan suasana, \"loh, kok kaku ngene seh\" (kok jadi canggung gini sih) Bima mendekati Widya,</p><p>\"awakmu pasti pegel kan,\" \"istirahat sek Wid\" (kamu pasti kecapekan kan, yao istirahat dulu Wid) kata Bima.</p><p>namun, Nur dan ayu, memandang sengit perlakuan Bima, sehingga Widya merasa ada yang salah dengan mereka semua.</p><p>namun, Wahyu yang sedari tadi menggendong isi tasnya, langsung mengambil alih perhatian mereka, dengan nafas menggebu-nggebu, ia bercerita pengalamanya yang baru saja di tolong warga desa tetangga karena motornya mogok, namun, anehnya, semua orang memandang Wahyu dengan sinis</p><p>Bima yang pertama menanggapi ucapan Wahyu.</p><p>\"Deso tetangga opo? gak onok maneh deso nang kene?\" (desa tetangga apa, gak ada lagi desa disini) kata Bima mengingatkan.</p><p>\"halah, ngapusi, eroh teko ndi awakmu?!\" (halah, bohong kamu, tahu darimana?) sanggah Wahyu saat itu.</p><p>\"aku wes sering nang kota, mbantu warga deso dodolan hasil alam, dadi gor titik aku paham wilayah iki\" (aku sudah sering ke kota, bantu warga jual bahan alam disini, jadi ya tau sedikitnya daerah ini)</p><p>\"ngapusi koen halah tot\" (bohong kamu dasar, sial)</p><p>Nur yang sedari tadi mendengar, membantu Bima, \"bener mas wahyu, gak onok deso maneh nang kene,\" (bener mas Wahyu, gak ada lagi desa disini.)</p><p>alih-alih setelah mendengar itu, Wahyu semakin tidak terima,ia kemudian memanggil Widya, \"Wid duduhno opo sing di kek\'I ambek warga sing nang tasmu\" (Wid tunjukan oleh-oleh yang di kasih tadi sama warga di dalam tasmu)</p><p>dengan enggan Widya membuka isi tasnya, Wahyu yang sudah tidak sabar segera merebutnya, meraihnya dengan tanganya, namun, ekspresinya berubah manakala ia mengeluarkan barang itu.</p><p>Widya yang melihat benda itu sama kagetnya dengan wahyu, namun Nur yang melihatnya tampak bingung, pun dengan semua orang saat itu, benda seperti apa yang di bungkus dengan pelepah daun pisang seperti itu.</p><p>Nur sempat melihat Wahyu dan Widya bertukar pandang, ia tahu ada yg salah</p><p>saat Wahyu membukanya, kaget, yang ada di dalamnya rupanya adalah kepala monyet terpenggal dengan darah yang masih segar.</p><p>seketika, reaksi semua orang membalikkan wajahnya, termasuk Nur yang segera mengambil kain untuk menutupinya, baunya amis dan membuat seisi ruangan mual</p><p>Wahyu tampak shock, Widya apalagi, Ayu segera membopongnya masuk ke dalam kamar, sementara Bima dan Anton, segera membereskan semua itu.</p><p>Wahyu, ia muntah sejadi-jadinya, semalaman, semua orang termenung dengan berbagai kejadian ganjil, termasuk Nur, dimana Widya mencuri pandang</p><p>Malam setelah Widya dan Ayu melepas penat, Nur terbangun, ia tiba-tiba teringat dengan ucapan Bima dan Ayu yang tanpa sengaja ia curi dengar.</p><p>dengan cekatan dan mengambil resiko, Nur mengambil isi tas Ayu, membawanya menuju ke pawon (dapur) sendirian. ia merasa, benda itu disana</p><p>Nur membongkar semua benda-benda itu, namun, tidak ada yang aneh, toh dia sudah mengeluarkan isi tasnya, sebelum, Nur sadar, masih ada resleting tas yang belum ia buka, tepat ketika Nur membukanya, ia bisa mencium aroma wewangian di dalamnya.</p><p>sebuah selendang hijau milik penari</p><p>tiba-tiba, tangan Nur seperti gemetar hebat, nafasnya menjadi sangat berat, tempat ia berada seakan-akan menjadi sangat dingin</p><p>dan, tabuhan kendang di ikuti alunan gamelan berkumandang, Nur tahu, si penari ada disini,</p><p>apa yang Ayu sebenarnya lakukan</p><p>apa yang Bima sembunyikan?</p><p>tepat saat itu juga, Nur melihat dengan mata kepala sendiri, Widya melangkah masuk ke pawon (dapur) matanya tajam menatap Nur, kaget setengah mati, Nur bertanya pada Widya.</p><p>\"nyapo Wid awakmu nang kene?\" (ngapain kamu wid, ada disini?)</p><p>namun Widya hanya berujar \"ojok di terusno\"</p><p>(jangan diteruskan)</p><p>Widya duduk di depan Nur, cara Widya berbicara sangat berbeda, mulai dari suara sampai logat cara menyampaikan pesanya, itu khas jawa sekali yang sampai Nur tidak begitu mengerti. yang Nur tangkap hanya kalimat \"salah\" \"nyawa\" \"tumbal\" itu pun tidak jelas</p><p>selain itu, setiap dia melihat Nur, ia seperti memberikan ekspresi sungkan, sepeti anak muda yang memberi hormat kepada orang tua.</p><p>kalimat terakhir yang Widya ucapkan sebelum kembali ke kamarnya adalah, \"kamu bisa pulang dengan selamat, saya yang jamin\" tapi dengan logat jawa</p><p>Nur membereskan semuanya saat itu juga, ia mengembalikan tas Ayu pada tempatnya, sempat ia melihat Widya yang tengah tidur, ia mengurungkan niat untuk membangunkanya, esok, ia harus bertemu dengan Bima, Nur yang paling sadar, tempat ini sudah menolak mereka semua.</p><p>sejak insiden itu, Ayu menghindari Nur, terlebih Bima apalagi, meski begitu, tidak ada yang nampak bahwa mereka sedang memiliki urusan, Widya wahyu dan Anton pun, di buat tidak sadar, bahwa ada permasalah internal pada kelompok KKN mereka. Nur, bingung, tidak ada yang bisa-</p><p>untuk di ajak berbagi, kecuali. mbah Buyut, namun, ia tidak tahu dimana beliau tinggal, pun Nur sudah mencoba mengelilingi desa, tak di temui sosok lelaki tua itu, sehingga akhirnya, Nur berinisiatif menyelesaikan ini sendiri, ia menemui Bima, sore itu, mengajaknya ke tepi sungai</p><p>\"ceritakno sing gak isok mok ceritakne nang ngarep\'e Ayu\" (ceritakan yang gak bisa kamu ceritakan didepan Ayu)</p><p>Bima tampak menimbang apakah dia harus bicara atau tidak sampai akhirnya ia menyerah dan mengatakanya.</p><p>\"aku khilaf Nur\" kata Bima,</p><p>\"cah iki, pancet ae\" (benar2 ya)</p><p>\"gak, gak iku. aku pancen khilaf wes ngunu ambek ayu, tapi aku luweh khilaf, wes nyobak-nyobak melet Widya\" (bukan, bukan itu, aku memang khilaf sudah melakukan itu sama Ayu, tapi aku lebih khilaf sudah mencoba membuat Widya suka sama aku)</p><p>\"maksude?\" tanya Nur penasaran.</p><p>\"nang nggon sing mok parani, iku onok sing jogo, arek wedok ayu, jeneng\'e dawuh\" (di tempat yang kamu datangi ada penjaganya, seorang perempuan cantik, namanya dawuh)</p><p>\"jin\" tanya Ayu,</p><p>\"gak. menungso\" (tidak. manusia)</p><p>\"mosok onok, iku ngunu jin,\" (mana ada, itu jin)</p><p>terjadi perdebadan sengit antara Nur dengan Bima, dengan bersikeras Bima mengatakan yang ia temui seorang perempuan warga desa ini. namun, Nur membantah, tidak ada yang tinggal disana, lagipula tempat itu di larang sejak awal. namun, Bima terus menolak sampai tanpa sengaja,</p><p>-menampar Nur, hingga terseok di tepi sungai, Nur pun menghujani Bima dengan batu, seakan-akan kepala Bima sudah tidak beres, sampai akhirnya Bima mengatakan, \"arek iku, wes ngekek\'i aku, Kawaturih kanggo Widya, jarene iku jimat ben aku ambek arek\'e di persatuno\"</p><p>(perempuan itu, sudah memberiku semacam mahkota putih yang ada di lenganya, yang katanya, itu bisa membuat Widya selalu nempel sama aku)</p><p>Nur yang mendengar itu, semakin tersulut, \"goblok yo koen, gorong 4 tahun, wes rusak utekmu, syirik koen Bim\"</p><p>(bodoh ternyata kamu ya, belum 4 tahun sudah rusak isi kepalamu, yang kamu lakukan itu menyekutukan Bim)</p><p>\"nang ndi barang iku sak iki?\" (dimana sekarang barang itu?) tanya Nur,</p><p>\"di gowo Ayu, nek jarene, wes ilang\" (dibawa oleh Ayu, katanya, sudah hilang)</p><p>\"aku gak ngurus Bim, balekno barang gak bener iku, awakmu gak paham ambek kelakuanmu, iku ngunu isok gowo balak\"</p><p>(aku tidak perduli, gimana caranya, kembalikan barang itu, kamu gak mengerti, perbuatanmu, bisa mendatangkan malapetaka)</p><p>Nur pergi, sekarang, ia tahu harus kemana, menemui Ayu.</p><p>Nur barusaja bertemu dengan Ayu setelah keluar dari rumah pak Prabu, Nur tidak mengerti apa yang barusaja dia lakukan.</p><p>\"lapo koen?\" (ngapain kamu)</p><p>Ayu mencoba menahan malu, setiap kali melihat Nur, mata Ayu seperti meratap atas apa yang sudah ia perbuat, dan itu fatal.</p><p>\"gak popo Nur, tak cepetno, ben proker\'e arek -arek cepet mari, mari iku ayo balik, pokok\'e fokus KKN kabeh yo\" (gak papa Nur, aku percepat urusanya, biar anak-anak semuanya bisa fokus garap proker mereka, kita juga harus kembali, intinya fokus dulu sama KKN ya)</p><p>\"aku pengen ngomong yu, soal\" (aku mau ngomong yu, soal) kata Nur yang terhenti melihat Anton mendekat, nafasnya terengah-engah, \"Nur, warga sing mbantu, kerasukan kabeh, rusak proker kene iki\" (Nur, warga yang bantu proker kita kerasukan, rusak semua proker kita)</p><p>Ayu, Nur dan Anton pergi ke lokasi, waktu itu ramai, dan ketika Nur tiba, seorang pria yang di pegangi oleh warga, tampak melotot melihat Nur, ia menunjuk Nur seakan biang masalah di desa ini, ia menyentak dengan suara berat. \"Tamu di ajeni tambah ngelamak koen, mrene koen\"</p><p>(Tamu sudah dihormati tambah seenaknya, kesini kamu kesini!!)</p><p>Nur kaget, ia di lindungi warga lain, tidak hanya pria itu, ada satu lagi, yang juga di tahan, sayangnya, pria yang satu lagi, melotot pada pria pertama, seakan ia marah pada warga desa itu. \"aku wes janji-</p><p>jogo cah iki, awakmu ra oleh gawe perkara ambek arek iki\" (saya sudah berjanji sama seseorang untuk jaga anak ini, kamu tidak boleh membuat masalah sama dia)</p><p>warga yang resah akhirnya membawa Nur ke rumah mereka, berikut Ayu dan Anton, di ikuti yang lain, kecuali, Widya.</p><p>saat Wahyu di konfirmasi, dimana Widya, Wahyu mengatakan Widya sama warga lain melanjutkan prokernya, tidak ada yang tahu mereka ada di salah satu rumah warga,</p><p>namun, ketika langit mulai petang, Nur hilang dari kamarnya, warga yang tahu, panik. terakhir kali, Nur pingsan.</p><p>Nur terbangun dalam keadaan menggunakan mukenah sholat dan ada Widya di sampingnya, namun, wajah Widya tampak tegang, Widya tidak bisa menyembunyikan bahwa ia baru saja mengalami kejadian janggal.</p><p>\"ket kapan isok ndelok Nur?\" (sejak kapan kamu bisa lihat begituan?)</p><p>Nur yang mendengar itu kaget, sejak kapan Widya tahu dan bertanya soal itu. mereka terjebak dalam suasana canggung. Nur jadi berpikir, bahwa kunci semuanya, mungkin ada pada Widya,</p><p>sejak awal, Widya juga yang paling aneh di tempat ini.</p><p>\"aku gak isok ngomong Wid, penjelasane ruwet, tapi, aku wes keroso ngene iki ket mondok,\" kata Nur, \"Ghaib iku nyata Wid\"</p><p>(aku gak bisa jelaskan secara spesifik, tapi, aku sudah merasa begini sejak mondok, yang jelas, ghaib itu nyata Wid)</p><p>\"awakmu onok sing jogo ya?\" (kamu ada yang jaga ya?) tanya Widya, yang membuat Nur semakin kaget, bingung harus menjelaskanya, ia harus mengingat bahwa sebelum keluar dari pesantren, banyak temanya yang bilang, setiap malam, Nur terbangun dan melafaldzkan doa yang bahkan-</p><p>sangat susah di hafal oleh santri pondok saat itu.</p><p>teman-temanya sampai memanggil guru mereka, agar Nur di ruqiah, namun, guru Nur menolak, beralasan bahwa, selama tidak menganggu keimanan Nur, di biarkan saja, daripada menjadi boomerang untuk Nur, bahkan,</p><p>guru Nur sudah berulang kali menjelaskan bahwa, ia harus tetap mengimankan kepercayaanya, tidak perlu memperdulikan jin model apa yang mengikutinya selama ini.</p><p>si guru memanggil jin itu dengan nama \"Mbah dok\" karena berwujud wanita tua.</p><p>tanpa Nur sadari, itu adalah kali pertama ia bisa bicara lagi sama Widya setelah lama, ia seolah saling menjauhi satu sama lain, Nur menceritakan semuanya, pengalaman di pondok hingga ia keluar darisana, kecuali, insiden ganjil di tempat ini, Nur masih menyimpanya sendiri.</p><p>karena Nur percaya, Widya punya apa yang ia cari selama ini, meski itu hanya asumsi, namun, ia yakin, Widya memilikinya.</p><p>hingga, kesempatan itu muncul, Nur, melihat kamar, tanpa ada satu orangpun, Ayu dan Widya mengerjakan proker mereka, Nur membuka almari, mengeluarkan-</p><p>isi tas Widya.</p><p>ia membongkar semuanya, mencari hingga ke celah terkecil di tas yang Widya bawa, semua persedian yang ia bawa tak luput dari pencarianya, sampai, Nur akhirnya menemukanya.</p><p>sebuah logam melingkar, dengan bentuk ukiran dari kemuning, bentuknya indah layaknya-</p><p>sebuah perhiasan, tidak hanya itu, di tengahnya, ada batu mulia berwarna hijau, dengan wajah bingung, Nur bergumam sendiran \"Kawaturih\" itu, bagaimana bisa ada pada Widya.</p><p>melihat itu, Nur sudah hilang kesabaran, ia membongkar isi tas Ayu, mengambil selendang hijaunya, 2 benda itu, Nur simpan pada sebuah kotak kayu yang ia temukan di pawon (dapur) tempat biasa untuk menyimpan bumbu masakan, tidak hanya itu, Nur menutupinya dengan kain putih, yang-</p><p>di dalamnya, ada kitab agamanya. Nur menyembunyikan tepat di bawah meja kamar, tertutup taplak meja. lalu, Nur pergi mencari Ayu,</p><p>setelah menemukan Ayu di tempat proker, Nur menarik Ayu, membawanya menjauh sebelum menampar wajahnya sampai Ayu, tidak bisa bicara apa-apa.</p><p>\"gak waras koen yo, barang ngunu mok deleh nang tas\'e Widya!! cah edan, kate makakno Widya koen yo, gak cukup ambek masalahmu opo!!\" (gak waras kamu ya, barang seperti itu, sengaja di tarus di tas Widya!! orang gila, mau kamu umpankan Widya ya, apa gak cukup sama masalahmu!!)</p><p>\"jelasno kok isok-isokne awakmu tego, yo opo penjelasanmu isok nduwe barang-barang gak bener iku?!\" (jelaskan kok bisa kamu tega ya, gimana penjelasanmu kok bisa punya barang seperti itu)</p><p>\"barang opo to Nur?!\" (barang apa sih Nur?) tanya ayu.</p><p>\"selendang hijau iku\"</p><p>Ayu yang mendengar itu tampak kaget.</p><p>\"kok isok awakmu eroh Nur, awakmu kelewatan mbongkar barang pribadine wong liya yo\" (kok bisa kamu tahu, kamu itu kelewatan kok bisa bongkar barang milik orang lain)</p><p>\"sak iki, melu aku nang pak Prabu, ayok\" (sekarang, ikut aku ke pak Prabu)</p><p>Nur menarik Ayu, menyeretnya kuat-kuat, namun Ayu menolak sebelum ia mengatakanya.</p><p>\"aku di kongkon ndeleh iku, gawe gantine selendang iku\" \"selendang sing nggarai Bima gelem mbek aku\"</p><p>(aku disuruh naruh benda itu, sebagai pengganti selendang itu, selendang yang bikin Bima mau)</p><p>\"sopo sing ngekek\'i iku?\" (siapa yang ngasih itu?) tanya Nur, namun Ayu menolak mengatakanya.</p><p>\"sopo kok!!\" (siapa kok!!)</p><p>Ayu tetap menolak, bahkan sampai Nur mengatakan apa perempuan yang juga Bima temui yang menyuruhnya, ekspresi Ayu tampak kaget mendengarnya,</p><p>Ayu mengatakan bahwa ia tidak tahu menahu siapa perempuan itu, dan siapa yang memberinya juga tidak ada hubunganya sama perempuan itu, bahkan sekalipun, Ayu tidak pernah bertemu perempuan yang di katakan Bima sangat cantik itu</p><p>Nur menyerah, namun firasat buruknya, semakin terasa</p><p>(ada hal ganjil disini, yang Nur sadari di kemudian hari, orang atau makhluk yang memberi Nur selendang ini, siapa?</p><p>sampai akhir cerita ini belum dipecahkan, bahkan dari saat gw bicara sama mbak Nur, beliau hanya berasumsi, namun tidak berani mengatakan)</p><p>puncaknya, adalah setelah malam panjang itu. disini, petaka yang paling di takutkan oleh Nur, terjawab.</p><p>Nur terbangun ketika subuh, ia tersentak saat mendengar Widya menangis, tangisanya sangat keras sampai Nur terkesiap lalu terbangun dari tidurnya</p><p>saat ia melihat, apa yang membuatnya terbangun, Nur melihat Ayu, dengan mata terbuka, ia mengangah, seperti mau mengatakan sesuatu</p><p>belum berhenti sampai disana, Nur tidak menemukan Widya di tempatnya, hal itu, membuat Nur menjerit sehingga Wahyu dan Anton merangsek masuk dengan wajah khawatir.</p><p>\"onok opo Nur? (ada apa Nur?)</p><p>\"Widya ilang mas\" (Widya hilang mas)</p><p>Wahyu dan Anton terhenyak sesaat, sebelum-</p><p>\"Bima yo gak onok nang kamar loh\"(Bima juga gak ada di dalam kamar) kata Anton buru-buru,</p><p>sontak, semua mata memandang Ayu, Wahyu terhentak bingung.</p><p>\"Ayu kenek opo Nur\" (Ayu kenapa Nur)</p><p>\"celukno pak Prabu!!\" (panggilkan pak Prabu)</p><p>Anton yang mendengarnya langsung pergi.</p><p>\"yu, tangi yu!!\" (yu ayok bangun yu) namun, Ayu masih sama, ia hanya melihat langit-langit, Nur manah mulutnya agar tertutup, namun, ia terus mengangah, Wahyu yang melihat tidak bisa berbuat apa-apa</p><p>\"Cok onok opo seh iki\" (asem, ada apa sih ini)</p><p>\"celokno warga ojok ndelok tok!\"</p><p>Wahyu pun ikut pergi, Nur terus menahan mulut Ayu. sampai Pak prabu datang bersama Anton dan melihatnya.</p><p>\"kok isok koyok ngene to nduk\" (kok bisa sampai begini sih nak)</p><p>Pak prabu, pergi ke pawon, ia kembali membawa teko air, Nur menahan isi kepala Ayu, dan meminumkanya.</p><p>tiba-tiba, ayu menutup mulutnya, namun, ia masih belum bereaksi, tidak beberapa lama, warga sudah berdatangan bersama Wahyu, saat itu, rumah itu di penuhi warga, tanpa banyak bicara, pak Prabu menyuruh beberapa orang untuk memanggil mbah Buyut.</p><p>dan warga itu pun pergi.</p>','',NULL,'https://api.maba.my.id/storage/1/1603673754.jpg',NULL,NULL,NULL,1,NULL,2,0,163,2,1,NULL,NULL,'2020-10-25 09:55:54','2021-01-13 06:08:09',NULL),(9,1,'#part7 Cerita horor KKN di Desa Penari terus-menerus menjadi pembicaraan warganet. tanda pagar (tagar) #kkndesapenari, yang kini berubah menjadi #kkndidesapenari, masih menjadi trending topic di posisi teratas Aplikasi Maba untuk wilayah Indonesia.','<p>Nur menjelaskan kronologi kejadian itu, namun, ia meminta pak Prabu tidak menceritakan semua ini kepada warga, Anton dan Wahyu yang mendengarnya seakan tidak percaya dengan apa yang ia dengar.</p><p>\"Asu, kok isok loh\" (anj*ng! kok bisa bisanya) Wahyu tampak merah padam mendengarnya.</p><p>pak Prabu pun mengumpulkan warga, meminta mereka semua pergi menyisir setiap penjuru Desa, ia beralaskan, bahwa Bima dan Widya hilang kemarin malam, dan saat ini belum kembali.</p><p>meski warga awalnya bingung, bagaimana bisa, namun mereka semua langsung bergerak, termasuk Wahyu</p><p>Anton pun begitu, ia ikut menyisir ke hilir sampai hulu sungai, sebisa mungkin dengan beberapa warga yang membawa parang dan berbagai barang yang tidak pernah ia pahami.</p><p>Nur terus menangis, melihat kondisi Ayu, membuat ia tidak bisa menahan kesedihan yang sudah memenuhi hatinya</p><p>pak Prabu meminta penjelasan lebih detail, setelah itu, Nur menunjukkan barang yang seharusnya ia berikan kepada pak Prabu saat mendapatkanya.</p><p>tepat ketika membuka kotak itu, pak Prabu yang melihatnya, kaget bukan main, sampai ia tiba-tiba berteriak marah \"OLEH TEKAN NDI IKI?!\"</p><p>(DAPAT DARIMANA KAMU BENDA INI!!)</p><p>Nur yang kaget, kemudian menjelaskan sisa ceritanya, disana, pak Prabu terlihat frustasi, ia kemudian mengatakan kepada Nur, \"nek kancamu gak ketemu, ikhlasno, ben aku sing ngadepi masalah iki\" (bila sampai temanmu, tidak ditemukan, ikhlaskan biar aku yang menghadapi sisanya)</p><p>Nur pun bertanya, benda apa itu sebenarnya, namun pak Prabu tidak bicara, ia harus menunggu datangnya mbah Buyut yang akan menceritakan semuanya.</p><p>berjam-jam sudah di lewati namun belum ada kabar satupun dari warga yang kembali, sampai terdengar suara motor mendekat, manakala Nur dan pak Prabu berdiri untuk melihat sesiapa yang datang,</p><p>mbah Buyut mendetak dengan tergopoh-gopoh, seakan mencari sesuatu,</p><p>mbah Buyut mengambil kawaturih, kemudian bertanya siapa yang punya, Nur mendekat, menjelaskan semuanya, ekspresi tenang mbah Buyut, tidak terlihat sama sekali.</p><p>kemudian ia menatap Ayu, helaan nafas berat mbah Buyut keluarkan, kemudian ia, meminta Prabu membuatkan kopi hitam</p><p>mbah Buyut duduk sembari berpikir, banyak pertanyaan yang ia ajukan mulai, sejak kapan ada benda seperti ini disini, lalu bagaimana bisa selendang itu di miliki Ayu,</p><p>Nur menceritakan semuanya,</p><p>saat menyesap kopi itu, mbah Buyut berujar \"kancamu, keblubuk angkarah\"</p><p>(temanmu terjebak dalam pusaran)</p><p>\"trus, yok nopo mbah?\" (lalu bagaimana mbah)</p><p>\"siji kancamu wes ketemu, tapi sukmane gorong, tenang sek, yo\" (satu temanmu sudah ketemu lagi, tapi rohnya belum, sabar ya)</p><p>tidak beberapa lama, kerumunan warga mendekat, Wahyu masuk wajahnya pucat</p><p>seorang warga membopong seseorang.</p><p>ketika Nur melihatnya, ia tidak bisa menghentikan jeritanya, manakala melihat Bima kejang-kejang layaknya seorang yang terkena epilepsi.</p><p>Wahyu, segera memeluknya, menutupi Nur agar tidak melihat Bima yang menjadi seperti itu.</p><p>Mbah buyut kemudian mengatakan, bahwa bila sukma dua orang ini sedang terjebak, namun, ada satu orang yang bukan hanya sukmanya yang hilang atau di sesatkan, melainkan raganya juga ikut disesatkan, ia adalah Widya, orang yang paling di inginkan oleh, Badarawuhi namun, ia meleset</p><p>Mbah buyut menunjukkan kawaturih, yang harusnya memiliki pasangan, benda ini di letakkan di lengan seorang penari, sebagai susuk, entah ada kejadian apa, Badarawuhi menginginkan benda ini ada pada Widya, namun, Nur yang menemukanya, kemudian mengambilnya, membuat benda ini-</p><p>kehilangan pemilik, yang maka artinya, Nur yang memiliki, tapi, Nur di lindungi, itulah alasan kenapa Nur selalu merasakan bahwa badanya terasa berat di jam-jam tertentu, mbah Dok yang melindungi Nur sudah berkelahi hampir dengan setengah penghuni hutan ini.</p><p>setelah itu, pak Prabu meminta agar Ayu dan Bima di tutup oleh kain selendang, di ikat dengan tali kain kafan, membiarkanya seolah-olah mereka sudah tidak bernyawa.</p><p>mbah Buyut, pergi ke kamar, ia akan mencari Widya, menjelma sebagai Anjing hitam dengan ilmu kebatinanya</p><p>pak Prabu menceritakan bahwa memang ada rahasia yang tidak ia katakan dan alasan kenapa ia menolak keras di adakan kegiatan ini sejak awal.</p><p>tepat di samping lereng, ada tapak tilas, tempat penduduk desa ini mengadakan pertunjukkan tari, bukan untuk manusia namun untuk jin hutan</p><p>ia mengatakan, dulu, setiap di adakan tarian itu, untuk menghindari balak (bencana) bagi desa ini, seriring berjalanya waktu, rupanya, mereka yang menari untuk desa ini, akan di tumbalkan, masalahnya, setiap penari haruslah dari perempuan muda yang masih perawan.</p><p>\"tapi Ayu pak\" kata Nur membantah.</p><p>\"itu masalahnya\" kata pak Prabu, \"asumsi saya, Ayu sejak awal hanya sebagai perantara, ke Widya lewat Bima, namun, Ayu tidak memenuhi tugasnya, akibatnya, Ayu di buatkan jalan pintas, ia di beri selendang hijau itu. tau darimana selendang itu?\"</p><p>selendang para penari.</p><p>pak Prabu kemudian duduk, matanya merah padam, \"seharusnya saya menolak habis-habisan bila bukan karena dia adik teman saya\" \"selendang itu, adalah selendang yang keramat, tidak ada lelaki yang bisa menolak selendang itu saat di pakai oleh perempuan\"</p><p>\"nak Ayu tidak salah, nak Bima pun begitu, saya yang salah, seharusnya saya tolak kalian semua, toh anak-anak kami pun tidak ada yang tinggal disini, tempat ini, bukan untuk anak setengah matang seperti kalian\"</p><p>mendengar itu, membuat Nur tidak kuasa melihat Ayu,</p><p>hari semakin petang, ketika Matahari sudah benar-benar tenggelam, terdengar orang berteriak heboh, ia meneriakkan bila Widya sudah ketemu, pun saat itu juga, Mbah Buyut keluar, wajahnya tampak kecewa, sepertinya ia tidak bisa membawa Ayu dan Bima pulang, lebih tepatnya belum</p><p>momen ketika melihat Widya, membuat Nur tidak bisa bicara apa-apa, ia berjalan dengan gaguk, seperti barusaja menghadapi peristiwa yang sangat berat, bahkan, Widya berjalan dengan mata yang kosong, ia melihat Ayu terus menerus, mencoba memahami situasi.</p><p>\"Wid, tekan ndi awakmu\" (Wid darimana kamu?) tanya Nur,</p><p>\"onok opo iki Nur\" (ada apa ini Nur) kata Widya, matanya sembab melihat Ayu dan Bima terbujur,</p><p>Nur tidak sanggup menceritakanya, Wahyu kemudian berdiri mengatakan semuanya, Widya menjerit sejadi-jadinya, semua diam.</p><p>selang beberapa saat, mbah Buyut keluar, ia memanggil Widya, menyuruhnya untuk masuk, dan entah apa yang mereka bicarakan.</p><p>Nur masih mencoba membangunkan Ayu, meski hal itu, mustahil bisa dilakukan.</p><p>ketika melihat mbah Buyut keluar, Nur, Wahyu, dan Anton yang baru tiba, ikut masuk ke dapur, ia hanya melihat Widya murung, seperti memikirkan sesuatu.</p><p>Wahyu yang sedari tadi sudah menahan diri, mengatakan bahwa Bima dan ayu sudah kelewatan sehingga mereka juga kena getahnya.</p><p>Malam itu juga, pak Prabu mengumpulkan semua anak yang tersisa, ia mengatakan, sudah menghubungi pihak kampus, pun dengan kakak Ayu, yang sedang dalam perjalanan kesini. esok, mungkin mereka tiba</p><p>mbah Buyut, menjaga rumah ini, konon, semua lelembut sudah mengepung rumah ini.</p><p>pagi itu, Nur menemui pak Prabu meminta seharusnya ia menahan diri sebelum informan ini keluar, karena sebelumnya, mbah Buyut mengatakan bisa mengembalikan Ayu dan Bima, hanya tinggal menunggu waktu. namun ucapan pak Prabu membuat Nur tidak berkutik.</p><p>\"nek pancen isok, yo gak bakal akeh sing wes dadi korban, awakmu eroh patek ireng iku opo, nyoh kui korban sak durunge, nang ndi sak iki, wes gak onok\" (kalau memang bisa, ya gak mungkin ada korban, kamu tahu, kenapa ada nisan dengan kain hitam, itu korban sebelum kejadian ini)</p><p>\"gak nutup kemungkinan kancamu isok mbalik, tapi kemungkinane cilik, gak usah berharap, mbah Buyut asline wes mblenger, kudu urusan ambek bangsa iku\" (gak menutup kemungkinan memang temanmu bisa kembali, tapi, kemungkinanya kecil, mbah Buyut sudah bosan, berurusan dengan mereka\"</p><p>siang hari, rombongan orang dari kampuspun dengan beberapa wali datang, bahkan suara membentak dari mas Ilham bisa terdengar dari luar, ada tawar menawar dimana mbah Buyut menjanjikan agar Ayu dan Bima tetap disini, namun pihak keluarga menolak sampai mengancam, ini akan tersebar</p><p>akhir dari perjalanan KKN mereka selesai disini, bukan hanya pak Prabu yang terseret, pihak kampus efeknya lebih besar lagi, sampai harus menjanjikan bahwa masih ada jalan lain mengembalikan mereka.</p><p>KKN mereka, resmi di coret, tak ada hasil apapun selama pra kerja mereka.</p><p>Widya, butuh waktu lama untuk pulih setidaknya itu yang Nur dengar, sementara Nur menjelaskan kronologi kejadian pada Abah dan Umi, orang tua Bima, yang tidak henti-hentinya, mengadakan doa bersama di rumahnya, pukulan keras setiap Nur melihat air mata umi menetes.</p><p>ada kejadian menarik, dimana Nur di ceritakan oleh Umi, semalam sebelum Bima akhirnya meninggal, ia mengetuk pintu kamar, disana ia meminta maaf sama Abah dan Umi, kemudian pamit kembali ke kamar, sembari mengatakan ular-ular, dan di akhiri dengan hembusan nafas terakhirnya</p><p>namun, Nur juga diberitahu Abah, bahwa, apa yg di katakan Umi tempo hari tidak usah di pikirkan, karena Umi menceritakan tentang mimpinya, anaknya Bima masih kejang-kejang dan memang meninggal pada malam kejadian , semua itu mimpi Umi, mungkin itu cara Bima pamit dan memberitahu</p><p>masih mau lanjut apa besok saja, sekarang yang mbak Nur saksikan saat mendampingi Ayu, ia di ajak ke Ng**i yang katanya bisa menyembuhkan beliau.</p><p>sedikit panjang dan gw jadikan 1 thread saja. gimana?</p><p>Maksudnya gw sambung sama thread ini. Biar gak usah nyari thread lagi ya. Gw mau kelarin malam ini semuanya.</p><p>Mas Ilham menghubungi Nur, beliau meminta tolong agar Nur bersedia mendampngi Ayu selama proses penyembuhan, dimana dokter sudah angkat tangan dan mendiagnosa Ayu, lumpuh total yang tidak di ketahui penyebabnya. ia di beritahu oleh temanya, bahwa Nur adalah orang yang tahu semua</p><p>malam itu, Ayu di bawa ke kabupaten Ng**i, di perjalanan, Nur selalu melihat Ayu, matanya di tutup paksa dengan kain, melihatnya kadang membuat Nur merasa Ayu sadar ada dia di sampingnya.</p><p>namun tetap saja nihil, sampailah mereka di rumah orang yang menawarkan bantuan itu</p><p>sesampai disana, Ayu di tidurkan di atas pelepah daun pisang. yang kemudian, di masukkan dalam sebuah keranda, Nur yang melihat itu, mengatakan pada mas Ilham bahwa itu perbuatan tidak benar, namun, mas Ilham menolak. mengatakan mungkin masih bisa, mas Ilham sangat frustasi.</p><p>butuh waktu lama, sampai orang yang membantu tiba tiba, bangun dan mengatakan ia tidak sanggup.</p><p>Ayu, tidak dapat di selamatkan, kecuali, di bawa keluar dari pulau jawa. namun, hal itu, juga mustahil dilakukan.</p><p>\"ayu gorong wayahe mati, dadi, keadaane yo bakal koyok ngene sampe wayahe mati\" (ayu belum seharusnya meninggal, jadi dia akan terjebak seperti ini sampai waktunya tiba)</p><p>\"di bawa saja ke pulau K********N, saya ada saudara disana\" kata mas Ilham waktu itu.</p><p>\"masalahe arek iki gak oleh cidek segoro, nek cedek segoro, isok di matekno\" (masalahnya, anak ini di larang mendekati laut/samudera, bila tetap nekat dia mati)</p><p>\"kan isok numpak pesawat\" (kan bisa naik pesawat) kata mas Ilham,</p><p>\"isok pesawat gak liwat segoro?\" (memang bisa pesawatnya gak usah melewati laut)</p><p>setelah darisana itu, Ayu akhirnya di pulangkan, ia ada di rumah itu kurang lebih 3 bulan, sampai akhirnya menghembuskan nafas terakhir juga, setelah orang tua Ayu mengatakan sudah ikhlas, termasuk mas Ilham.</p><p>keikhlasan orang tua Ayu termasuk mencabut gugatan terhadap pihak kampus, dan juga sudah tidak mau menyalahkan siapapun, Ayu di kebumikan di makam keluarga, sembari di doakan, di situ, ibunya mengaku, sering melihat Ayu meneteskan air mata, dan inilah akhir cerita mbak Nur.</p><p>jadi gw bakal tutup Thread ini dengan pesan mbak Nur dan alasanya kenapa ia mau bercerita.</p><p>sejak awal, mbak Nur tidak begitu tertarik dengan unsur seram dalam ceritanya, ia ingin menyampaikan pesan yang terkandung di dalamnya, agar siapapun kita, tetap menjaga tata krama</p><p>ini bukan tentang, hal yang sepele, siapapun kamu, dimanapun kamu berada, sekali lagi, jaga sikap dan prilaku karena sesungguhnya sebagai tamu, selayaknya tetap bersiteguh pada warisan pendahulu kita yang mengutamakan sopan santun terhadap tuan rumah. gw simple_man undur diri.</p><p>mohon maaf atas typo, dan waktu yang kentang ya, sekali lagi, gw ucapkan banyak terimakasih yang sudah mengikuti sejak awal, dengan ini, Thread ini gw tutup selamanya!!</p><p>(kalau mau tanya-tanya, DM saja, di notifikasi gak begitu terbaca karena tertumpuk. selamat malam)</p>','',NULL,'https://api.maba.my.id/storage/1/1603673849.jpg',NULL,NULL,NULL,1,NULL,5,0,210,5,1,NULL,NULL,'2020-10-25 09:57:29','2021-01-08 11:01:47',NULL),(10,562,'Mau bikin tips and trick membuat essay',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,1,114,3,1,NULL,NULL,'2020-10-25 14:21:22','2021-01-13 06:08:08',NULL),(11,1,'Bangsat',NULL,NULL,NULL,NULL,NULL,'https://api.maba.my.id/storage/1/audio/1603704132.mp3',82,NULL,NULL,0,0,14,0,0,NULL,NULL,'2020-10-25 18:22:12','2020-11-01 11:40:01',NULL),(12,1,'Jangar Ku tugas',NULL,NULL,NULL,NULL,NULL,'https://api.maba.my.id/storage/1/audio/1603704241.mp3',86,NULL,NULL,0,0,16,0,0,NULL,NULL,'2020-10-25 18:24:01','2020-11-01 11:39:58',NULL),(13,1,'Nugas teruss',NULL,NULL,NULL,NULL,NULL,'https://api.maba.my.id/storage/549/audio/1603704382.mp3',86,NULL,NULL,0,1,16,1,0,NULL,NULL,'2020-10-25 18:26:22','2020-11-01 11:39