,(41,562,'Sekolah Tentang Essay : Essay/Esai adalah sebuah karya tulis ilmiah yang menghasilkan suatu produk dari kegiatan ilmiah.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,36,0,0,0,0,0,NULL,NULL,'2020-11-02 09:32:59','2020-11-02 09:33:37',NULL),(42,562,'Esai adalah uraian tulisan yang membicarakan bermacam ragam masalah, baik politik, sosial, hukum, ekonomi, pertanian dan lain sebagainya. Esai tidak tersusun secara teratur akan tetapi ada garis besar yang dapat dipetik dari bermecam-macam tulisan yang...',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,36,0,0,0,0,0,NULL,NULL,'2020-11-02 09:33:30','2020-11-02 09:33:46',NULL),(43,562,'Esai tidak tersusun secara teratur akan tetapi ada garis besar yang dapat dipetik dari bermacam tulisan yang diutarakan. - H.B JASSIN',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,36,0,0,18,0,1,NULL,NULL,'2020-11-02 09:34:28','2020-12-13 07:00:19',NULL),(44,562,'Esai adalah uraian tulisan yang membicarakan bermacam ragam masalah, baik politik, sosial, hukum, ekonomi, pertanian dan lain sebagainya.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,36,0,0,17,0,1,NULL,NULL,'2020-11-02 09:34:39','2020-12-13 11:12:43',NULL),(45,562,'Sekilas tentang Essay : Essay/Esai adalah sebuah karya tulis ilmiah yang menghasilkan suatu produk dari kegiatan ilmiah.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,36,0,0,25,0,1,NULL,NULL,'2020-11-02 09:35:03','2020-12-21 02:38:59',NULL),(46,562,'Struktur Essay','<p>Esai terbagi 3 bagian (tidak termasuk referensi/Daftar pustaka).</p><p>1. Pendahuluan<br><span style=\"font-size: 1.2rem; background-color: var(--theme-primary_dark); color: var(--theme-secondary);\">2. Pembahasan<br></span><span style=\"font-size: 1.2rem; background-color: var(--theme-primary_dark); color: var(--theme-secondary);\">3. Penutup (Kesimpulan/Saran)</span></p><p>Pendahuluan berisi tentang topik apa yang kamu angkat, seperti latar belakang, permasalahan, isu-isu yang sedang dibahas dan sebagainya. biasanya di pendahuluan ini kalian menjelaskan mengapa topik yang kalian pilih diangkat dan ditulis menjadi karya tulis Esai.<br></p><p>Mencakup seperti data-data, informasi fakta, dan dari penelitian-penelitian sebelumnya yang membahas tentang topik sejenis. dari sini kalian menjelaskan mengapa permasalahan ini timbul dan apa penyebabnya.<br></p><p>Lalu setelahnya masuk kepada pembahasan, pada pembahasan ini kalian menjelaskan ide yang kalian tuangkan. untuk pembahasan ini sebisa mungkin isi pikiran kalian dengan kata-kata yang kalian rangkai. Lalu kalian dapat memasukan kutipan/pembahasan dari penelitian sebelumnya.<br></p><p>Jadi kalian dapat mengolaborasikan kata-kata yang kalian buat dengan kata-kata dari jurnal oleh para ahli. Misal : Dalam inovasi periklanan, sangatlah penting bagi kita untuk menggaet konsumen sebanyak mungkin. Menurut (Para Ahli) Bahwa pemasaran yang baik adalah ...... (bla bla)<br></p><p>jadi kalian bisa cari pembahasan yang sesuai dengan apa yang kamu bahas, agar esai kalian sesuai dan dapat dikatakan tidak mengada-ngada dan memiliki pondasi yang kuat.<br></p><p>Lalu yang terakhir adalah kesimpulan dan saran. sangat penting membuat kesimpulan yang tidak membosankan. Maka kalian sebisa mungkin me recall pembahasan kalian dari mulai pendahuluan (mengapa topik ini diangkat) dan pembahasan (ide kalian).<br></p><p>Saran berfungsi agar ide/gagasan yang kita buat ini dapat diimplementasikan di masyarakat (cocok jika di realisasikan).<br></p>','',NULL,'https://api.maba.my.id/storage/562/1604339980.jpg',NULL,NULL,NULL,1,NULL,1,0,82,1,1,NULL,NULL,'2020-11-02 09:59:40','2020-12-21 02:38:59',NULL),(48,621,'Tes',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,29,0,0,1,0,1,NULL,NULL,'2020-11-06 17:56:01','2020-11-08 05:55:04',NULL),(49,553,'g',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,47,0,1,8,1,0,NULL,NULL,'2020-11-07 00:30:56','2020-12-06 17:00:45',NULL),(50,553,'Sudah sabtu malam aja.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,1,80,2,0,NULL,NULL,'2020-11-07 00:40:09','2020-12-06 17:00:47',NULL),(51,1,'Event',NULL,NULL,NU