ngerti betapa indahnya kata perjuangan dan pengorbanan.\"',NULL,NULL,NULL,NULL,NULL,NULL,82,NULL,NULL,2,0,172,2,1,NULL,NULL,'2020-11-16 07:55:48','2021-01-06 19:53:33',1),(70,1,'\"Hidup mahasiswa. Kami adalah pengawal reformasi yang setia bersama NKRI.\"',NULL,NULL,NULL,NULL,NULL,NULL,82,NULL,NULL,1,0,180,1,1,NULL,NULL,'2020-11-16 07:55:57','2021-01-06 19:53:40',1),(71,1,'\"Makin sulit sebuah perjuangan, maka akan makin indah ketika mencapai kemenangan. Jadilah mahasiswa yang tidak kenal lelah dalam meraih impianmu.\"',NULL,NULL,NULL,NULL,NULL,NULL,82,NULL,NULL,1,0,188,1,1,NULL,NULL,'2020-11-16 07:56:08','2021-01-06 19:53:40',1),(72,1,'\"Mahasiswa adalah pelindung masyarakat yang turun ke jalan memperjuangkan aspirasi bersama.\"',NULL,NULL,NULL,NULL,NULL,NULL,82,NULL,NULL,4,0,218,4,1,NULL,NULL,'2020-11-16 07:56:17','2021-01-11 15:04:37',1),(73,1,'\"Idealisme adalah kemewahan terakhir yang dimiliki oleh seorang pemuda.\" - Tan Malaka',NULL,NULL,NULL,NULL,NULL,NULL,82,NULL,NULL,1,0,191,1,1,NULL,NULL,'2020-11-16 07:56:28','2021-01-06 19:53:40',1),(74,1,'\"Buat apa wilayah seluas Sabang sampai Merauke, jika pemudanya kehilangan idealisme?\" - Najwa Shihab',NULL,NULL,NULL,NULL,NULL,NULL,82,NULL,NULL,2,0,198,2,1,NULL,NULL,'2020-11-16 07:56:37','2021-01-13 08:24:10',1),(75,1,'\"Tidak ada yang salah dengan mahasiswa yang aktif berpolitik. Justru seorang mahasiswa yang berpolitik adalah mereka yang memiliki daya pikir kritis dan aktif dalam setiap penanganan permasalahan yang terjadi terhadap bangsa ini.\"',NULL,NULL,NULL,NULL,NULL,NULL,82,NULL,NULL,2,0,200,2,1,NULL,NULL,'2020-11-16 07:56:46','2021-01-13 08:24:10',1),(76,1,'\"Menjadi mahasiswa aktivis adalah pilihan buat kamu yang ingin berpolitik setelah lulus. Tetapi, lebih dari itu, kamu yang aktif di organisasi adalah sosok yang memiliki nilai lebih terhadap seni manajemen hidup.\"',NULL,NULL,NULL,NULL,NULL,NULL,82,NULL,NULL,2,0,202,2,1,NULL,NULL,'2020-11-16 07:56:54','2021-01-13 08:24:10',1),(77,1,'\"Mahasiswa terbaik adalah mereka yang membawa perubahan positif bagi sekitarnya.\"',NULL,NULL,NULL,NULL,NULL,NULL,82,NULL,NULL,7,1,243,8,1,NULL,NULL,'2020-11-16 07:57:04','2021-01-11 15:03:53',1),(78,1,'\"Jangan takut dengan penguasa. Tapi, takutlah akan hidup sebagai mahasiswa yang tidak bisa apa-apa dan tidak bisa memberikan kontribusi terhadap bangsa dan negara.\"',NULL,NULL,NULL,NULL,NULL,NULL,82,NULL,NULL,2,0,223,2,1,NULL,NULL,'2020-11-16 07:57:14','2021-01-13 08:24:10',1),(79,1,'\"Perjuangan mahasiswa aktivis bukan hanya proses penderitaan menuju tujuan, apalagi mendapatkan pujian. Akan tetapi, adalah suatu proses untuk memantaskan diri demi meraih tujuan mulia.\"',NULL,NULL,NULL,NULL,NULL,NULL,82,NULL,NULL,5,0,249,5,1,NULL,NULL,'2020-11-16 07:57:23','2021-01-13 08:24:10',1),(80,1,'\"Seorang pemenang yang berhenti sebelum bertanding, sebenarnya adalah seorang pecundang. Orang kalah yang terus berjuang setelah kalah, adalah pemenang sejati.\"',NULL,NULL,NULL,NULL,NULL,NULL,82,NULL,NULL,3,0,238,3,1,NULL,NULL,'2020-11-16 07:57:34','2021-01-08 23:15:34',1),(81,1,'\"Mahasiswa aktivis selalu menghadapi masalah dengan solusi terbaik.\"',NULL,NULL,NULL,NULL,NULL,NULL,82,NULL,NULL,2,0,239,2,1,NULL,NULL,'2020-11-16 07:57:42','2021-01-10 19:41:21',1),(82,1,'\"Ingatlah hai para mahasiswa aktivis! Semua akan terlihat tidak mungkin sampai kalian selesai melakukannya.\"',NULL,NULL,NULL,NULL,NULL,NULL,82,NULL,NULL,2,0,243,2,1,NULL,NULL,'2020-11-16 07:57:50','2021-01-10 19:41:21',1),(83,1,'\"Makin sulit sebuah perjuangan, makin indahlah suatu kemenangan.\"',NULL,NULL,NULL,NULL,NULL,NULL,82,NULL,NULL,1,0,243,1,1,NULL,NULL,'2020-11-16 07:57:59','2021-01-10 19:41:21',1),(84,1,'\"Jangan takut bertemu kegagalan karena keberhasilan menunggumu di masa depan.\"',NULL,NULL,NULL,NULL,NULL,NULL,82,NULL,NULL,1,0,247,1,1,NULL,NULL,'2020-11-16 07:58:08','2021-01-10 19:41:21',1),(85,1,'\"Perjuangan bersama teman-teman aktivis ibarat mengendarai sepeda secara bersama-sama. Agar tetap seimbang, maka kalian harus 