,1,NULL,3,1,37,4,1,NULL,NULL,'2020-12-03 05:41:53','2021-01-05 02:19:25',NULL),(300,768,'Belajar Bareng nulis Essay sama Lingkar Cendekia #BahasEsaiAndy','<p>Esai itu sifatnya populer jadi beda dengan LKTI. Tapi untuk idenya, keduanya bisa sama temen2.</p><p><br></p><p>Untuk struktur di esai dibagi jadi 3&nbsp;</p><p>1. Pendahuluan membahas tentang urgensi dari masalah&nbsp;</p><p>2. Pembahasan mengupas tentang solusi yang kita angkat&nbsp;</p><p>3. Penutup memberikan kesimpulan atas solusi yang kita berikan di pembahasan tadi</p><p>Lalu biasanya kita akan sering berkutat dengan Ide</p><p>Kalau saya sendiri ada 3 metode</p><p>Yang pertama, ATM (Amati Tiru Modifikasi)</p><p>Yang kedua, kepekaan (melihat dari permasalahan yang ada di sekitar kita)</p><p>Yang ketiga, kolaborasi (menggabungkan beberapa sistem)</p><p>Ada 4 kriteria yang membuat gagasan kita juara, yaitu relevan, aplikatif, inovatif, dan kreatif.</p><p>#BahasEsaiAndy</p><p><ol><li></li></ol></p><p><ol><li></li></ol></p><p><ol><li></li></ol></p>',NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,3,2,64,5,1,NULL,NULL,'2020-12-03 16:42:27','2021-01-08 23:15:29',0),(301,562,'Kak dalam esai sendiri ada yg dinamakan bab per bab gak? Soalnya pas lomba pernah nemu ketentuan pake bab gitu',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,300,1,1,2,2,1,NULL,NULL,'2020-12-03 17:01:46','2020-12-13 06:59:53',NULL),(302,768,'Sebenernya kalau di esai sendiri tidak memakai istilah bab, karena kadang bisa ditulis seperti paragraf lepas tanpa dibagi-bagi',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,301,0,0,2,0,1,NULL,NULL,'2020-12-03 18:03:39','2020-12-04 09:20:48',NULL),(303,767,'Kak bagaimana untuk menulis esai secara terstruktur agar enak untuk dibaca ya?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,300,1,1,5,2,1,NULL,NULL,'2020-12-03 18:35:48','2020-12-06 21:27:49',NULL),(304,766,'Hallo guys, ada yg gemar berbisnis? Mau bisnis dan dapet modal bisnis dgn mudah? Yuk sharing2 bisnis plan bareng aku di #BahasBisnisKhusnul ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,3,54,5,1,NULL,NULL,'2020-12-04 15:40:04','2021-01-08 23:15:29',NULL),(305,766,'Hallo temen2, ada ngga yg suka nulis tapi ngga suka yg terlalu ilmiah dan lebih realistis? Nah buat yg suka bingung buat nulis yg ilmiah2 tapi punya segudang ide dan bakat berlogika, cocok bgt buat nyoba apply dan join lomba business plan competition.','<p>Pada dasarnya BPC sama seperti KTI, runtutan acara dan jumlah BAB dalam proposalnya. Bedanya apa? BPC bisa ditulis menggunakan bahasan yg lebih kamu bgt ngga terlalu baku dan ilmiah gpp terus selain itu isi proposalnya lebih kepada 3 hal nih 1) Latar Belakang didirikannya bisnis yg kita rintis/tawarkan, 2) Tujuan bisnis, dan 3) bagaimana mencapai tujuan tsb (strategi marketing, keuangan, produksi, dan SDM nya).</p><p>Oh ya buat yg belum tau, BPC itu tahapannya ada 3  kita buat Business Model Canvas (BMC), lolos lalu proposal BPC lengkap, lolos lg ke tahap presentasi.</p><p>Setiap tahapan punya cirinya masing2 lhooo... dan buat yg suka bgt sama tantangan jadi jawara lomba jg ada tips and trick lolos ketiga tahap itu dgn mudah mau tau? Selengkapnya kalian tanyakan aja dgn #BahasBisnisKhusnul yah</p><p>Ini semua berdasarkan pengalamanku ikut dan juara lomba BPC belasan kali yah, semoga bermanfaat dan kalian bisa ngalahin aku<br></p>','',NULL,'https://api.maba.my.id/storage/766/1607125601.jpg',NULL,NULL,NULL,1,NULL,4,2,56,6,1,NULL,NULL,'2020-12-04 15:46:41','2021-01-13 06:07:19',NULL),(306,1,'Ceritain dong, aku belum pernah PPL jadi pengen tau aja keseruannya.. biasanya ngapain aja',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,299,1,0,19,1,1,NULL,NULL,'2020-12-04 16:41:41','2021-01-09 19:17:46',NULL),(307,871,'Halo kak gimana caranyaa mulai bisnis tapi yg bikin semangat dan konsisten?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,304,0,0,1,0,0,NULL,NULL,'2020-12-04 17:17:09','2020-12-04 17:17:15',NULL),(308,871,'Halo kak gimana cara mulai bisnis tp yang bisa bikin kita semangatt dan konsisten?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NU